INSERT INTO `articles` VALUES (1,'Kérdőjelek az MVM-vezér körül','\r\n		Bár a Magyar Villamos Művek (MVM) Zrt. csupán az LMP lejárató kampányának tudja be az állami energiacég vezetőjét is érintő parlamenti vizsgálóbizottság létrehozásának sürgetését, egyre több a kérdőjel Baji Csaba körül.	','hirek/magyar-hirek/kerdojelek-az-mvm-vezer-korul','2011-11-17 20:34:29','2011-11-17 20:34:29',2,'http://www.k-monitor.hu/hirek/magyar-hirek/kerdojelek-az-mvm-vezer-korul',NULL,NULL,'normal',NULL),(2,'Elszállt milliárdok nyomában','\r\n		Ismét csődközeli helyzetben van a Malév, pedig több tízmilliárd forintot költöttek rá az adófizetők pénzéből az utóbbi tíz évben. Számvetés az okokról és a következményekről. Első rész.	','hirek/magyar-hirek/elszallt-milliardok-nyomaban','2011-11-17 20:35:00','2011-11-17 20:35:00',2,'http://www.k-monitor.hu/hirek/magyar-hirek/elszallt-milliardok-nyomaban',NULL,NULL,'normal',NULL),(3,'Kubatov kérte, hogy szabotáljon egy beruházást Demján cége?','\r\n		Kubatov Gábornak, a Fidesz pártigazgatójának kérésére nem fogott hozzá egy szentesi szálloda kivitelezéséhez a milliárdos üzletember, Demján Sándor cége, az Arcadom Zrt. – ez derül ki a hvg.hu birtokába került dokumentumokból, amelyekben maga a volt vezérigazgató hivatkozik a politikus „elvárásaira”.	','hirek/magyar-hirek/kubatov-kerte-hogy-szabotaljon-egy-beruhazast-demjan-cege','2011-11-17 20:35:04','2011-11-17 20:35:04',2,'http://www.k-monitor.hu/hirek/magyar-hirek/kubatov-kerte-hogy-szabotaljon-egy-beruhazast-demjan-cege',NULL,NULL,'normal',NULL),(4,'Hálapénzt a kórházaknak!','\r\n		A munka törvénykönyvének tervezete szerint a hálapénzt a munkáltató előzetes engedélyével el lehet fogadni.	','hirek/magyar-hirek/halapenzt-a-korhazaknak','2011-11-17 20:35:12','2011-11-17 20:35:12',2,'http://www.k-monitor.hu/hirek/magyar-hirek/halapenzt-a-korhazaknak',NULL,NULL,'normal',NULL),(5,'Repülnek a képviselők','\r\n		Kedden két parlamenti küldöttség is külföldre utazott. Portugáliába hárman repültek, Chilét egy magyar honatya célozza. Mi a feladat? Megkérdeztük. Sok kicsi interjú. Hallgatható is!	','hirek/magyar-hirek/repulnek-a-kepviselok','2011-11-17 20:35:12','2011-11-17 20:35:12',2,'http://www.k-monitor.hu/hirek/magyar-hirek/repulnek-a-kepviselok',NULL,NULL,'normal',NULL),(6,'Milliókat hordott magával sofőrje szerint Hunvald György','\r\n		A tanú állítása szerint látta a kötegelt 20 ezres címletű bankjegyeket a volt erzsébetvárosi polgármester táskájában, borítékban, vagy újságba rejtve, és maga Hunvald többször el is mesélte neki, mire valók ezek a pénzek.	','hirek/magyar-hirek/milliokat-hordott-magaval-soforje-szerint-hunvald-gyorgy','2011-11-17 20:35:17','2011-11-17 20:35:17',2,'http://www.k-monitor.hu/hirek/magyar-hirek/milliokat-hordott-magaval-soforje-szerint-hunvald-gyorgy',NULL,NULL,'normal',NULL),(7,'\"Marhaságok\" a K & H-perben','\r\n		Újabb ügyféltanút hallgatott meg a Fővárosi Bíróság a K & H-perben, ezúttal ifjabb Mudura Sándor, Medgyessy Péter exkormányfő kebelbarátja fiának kellett válaszolnia kérdésekre. Ifjabb Mudurát az elsőrendű vádlott, Kulcsár Attila a 2-es számú ügyfélcsoportba sorolta be, ahová azok tartoztak, akiknek olyan magas hozamelvárásuk volt, amely törvényesen nem volt teljesíthető.	','hirek/magyar-hirek/marhasagok-a-kaah-perben','2011-11-17 20:35:18','2011-11-17 20:35:18',2,'http://www.k-monitor.hu/hirek/magyar-hirek/marhasagok-a-kaah-perben',NULL,NULL,'normal',NULL),(8,'BKV-akták 2.: Zsarolás és fiktív számlázás az egyik tanácsadó cégnél','\r\n		Egy gyanús tanácsadói szerződés hátteréről rántotta le a leplet a BKV-s ügyekben a Központi Nyomozó Főügyészségen az a Pálocska János, aki ellen három évvel ezelőtt zsarolás miatt indult büntetőeljárás, s akit korábban összefüggésbe hoztak az ukrán Leonyid Stecurával, mivel az ő cégeinek környezetében bukkant fel. Cikksorozatunk második része.	','hirek/magyar-hirek/bkv-aktak-2-zsarolas-es-fiktiv-szamlazas-az-egyik-tanacsado-cegnel','2011-11-17 20:35:19','2011-11-17 20:35:19',2,'http://www.k-monitor.hu/hirek/magyar-hirek/bkv-aktak-2-zsarolas-es-fiktiv-szamlazas-az-egyik-tanacsado-cegnel',NULL,NULL,'normal',NULL),(9,'Milliókat vett fel tanácsadásért a volt fideszes EP képviselő','\r\n		De Blasio Antonio volt fideszes Európai parlamenti képviselő cége havi nettó 300 ezer forintot kap a pécsi városházától tanácsaiért az EKF beruházásokat, külkapcsolatokat és európai ügyeket illetően.	','hirek/magyar-hirek/milliokat-vett-fel-tanacsadasert-a-volt-fideszes-ep-kepviselo','2011-11-17 20:35:33','2011-11-17 20:35:33',2,'http://www.k-monitor.hu/hirek/magyar-hirek/milliokat-vett-fel-tanacsadasert-a-volt-fideszes-ep-kepviselo',NULL,NULL,'normal',NULL),(10,'A Rio nem fizet, és nem is költözik','\r\n		22 milliós elmaradása van a nyár végén bezárt Cafe del Rio tulajdonosának a közterületi díjak fizetésében, és az épületek elbontásával is túllépte a szerződésében rögzített határidőt.	','hirek/magyar-hirek/a-rio-nem-fizet-es-nem-is-koltozik','2011-11-17 20:35:35','2011-11-17 20:35:35',2,'http://www.k-monitor.hu/hirek/magyar-hirek/a-rio-nem-fizet-es-nem-is-koltozik',NULL,NULL,'normal',NULL),(11,'Az udvari médiakommunikátor','\r\n		Patonai Péter a tavalyi országgyűlési választások utáni nyáron vásárolta meg a 2002-ben alapított I.M.G. Inter Media Group (IMG) nevű reklámcéget a szintén ismeretlen Berlink International Ltd.-től, melyet az ismertebb offshore színhelyek közül történetesen az amerikai Delaware-ban jegyeztek be.	','hirek/magyar-hirek/az-udvari-mediakommunikator','2011-11-17 20:35:39','2011-11-17 20:35:39',2,'http://www.k-monitor.hu/hirek/magyar-hirek/az-udvari-mediakommunikator',NULL,NULL,'normal',NULL),(12,'Az MVM is havi 1 millióval honorálta Baji Csabát a szocialista panamák idején','\r\n		A birtokunkba került dokumentumok szerint az MVM Zrt.-nek és egy az MVM-et több mint százmillió forinttal megkárosító offshore cégnek is havi 1-1 millió forintot értek az elmúlt években, szocialista kormányok idején a jelenlegi MVM-vezér Baji Csaba tanácsai.	','hirek/mag