rikai üzletemberek\" a magyar fürdőbizniszben','\r\n		Hargitai György és köre lehettek a félresikerült egerszalóki fürdőberuházás \"amerikai befektetői\", valamint a konkurens demjéni és a csak az ötlet fázisáig jutó kiskőrösi fürdő háttértámogatói.	','hirek/magyar-hirek/amerikai-uzletemberek-a-magyar-furdobizniszben','2011-11-17 20:47:07','2011-11-17 20:47:07',2,'http://www.k-monitor.hu/hirek/magyar-hirek/amerikai-uzletemberek-a-magyar-furdobizniszben',NULL,NULL,'normal',NULL),(82,'Aranyiszap','\r\n		Nem spóroltak az állami pénzzel a vörösiszap-katasztrófa utáni helyreállításnál. A milliárdok felhasználása azonban kevéssé vizsgálható. Sem a Belügyminisztérium Országos Katasztrófavédelmi Főigazgatóságának főigazgatója, Bakondi György, sem a Vidékfejlesztési Minisztérium első embere, Fazekas Sándor nem közli lapunkkal azoknak a cégeknek a teljes névsorát, amelyek részt vettek az államilag vezényelt munkálatokban. Így azt sem tudtuk meg, milyen nagyságrendben részesült a megbízásokból a Fidesz meghatározó háttérembere, Simicska Lajos hozzátartozóinak cége.	','hirek/magyar-hirek/aranyiszap','2011-11-17 20:48:20','2011-11-17 20:48:20',2,'http://www.k-monitor.hu/hirek/magyar-hirek/aranyiszap',NULL,NULL,'normal',NULL),(83,'Madarakat veszélyeztet a Hubertus Bt. tevékenysége','\r\n		Súlyosan veszélyezteti a vízi élővilágot a Balaton déli partján, a Nagybereki Fehérvíz Természetvédelmi Területen a Hubertus Bt. tevékenysége – állapította meg frissen lezárult vizsgálatában Fülöp Sándor, a jövő nemzedékek országgyűlési biztosa.	','hirek/magyar-hirek/madarakat-veszelyeztet-a-hubertus-bt-tevekenysege','2011-11-17 20:49:37','2011-11-17 20:49:37',2,'http://www.k-monitor.hu/hirek/magyar-hirek/madarakat-veszelyeztet-a-hubertus-bt-tevekenysege',NULL,NULL,'normal',NULL),(84,'Kartellgyanúban a megyei lapkiadók','\r\n		A Gazdasági Versenyhivatal 2011. szeptember 19-én előzetes értesítés nélküli helyszíni szemlét tartott az Axel Springer-Magyarország Kft. és az Inform Média Kft. üzleti he