/magyar-hirek/hatterbol-az-elso-sorba-giro-szasz-andras-kormanyszovivo','2011-11-17 20:53:12','2011-11-17 20:53:12',2,'http://www.k-monitor.hu/hirek/magyar-hirek/hatterbol-az-elso-sorba-giro-szasz-andras-kormanyszovivo',NULL,NULL,'normal',NULL),(117,'Letudta MFB-s hiteleit a péti Nitrogéművek','\r\n		A társaság közleménye szerint egy összegben előtörlesztette a péti Nitrogénművek Vegyipari Zrt. azokat a kölcsönöket, amelyeket az MFB Magyar Fejlesztési Bank nyújtott a cégnek.	','hirek/magyar-hirek/letudta-mfb-s-hiteleit-a-peti-nitrogemuvek','2011-11-17 20:53:12','2011-11-17 20:53:12',2,'http://www.k-monitor.hu/hirek/magyar-hirek/letudta-mfb-s-hiteleit-a-peti-nitrogemuvek',NULL,NULL,'normal',NULL),(118,'Űrgammák újratöltve – kikérjük a Marslakók szerződését','\r\n		Jáksó László televíziós celeb cége Marslakók címmel napi szappanoperát fog gyártani a közmédiumoknak, a több évre szóló, milliárdos nagyságrendű koprodukciós szerződést hétfőn írták alá.	','hirek/magyar-hirek/urgammak-ujratoltve-a-kikerjuk-a-marslakok-szerzodeset','2011-11-17 20:53:13','2011-11-17 20:53:13',2,'http://www.k-monitor.hu/hirek/magyar-hirek/urgammak-ujratoltve-a-kikerjuk-a-marslakok-szerzodeset',NULL,NULL,'normal',NULL),(119,'Kocsis a BKV nevében is aláírt fura szerződéseket','\r\n		Kocsis István, a BKV napokban távozó vezérigazgatója különös szerződéshosszabbításokat jegyzett a közlekedési vállalat reklámhelyeit tizenkét éve használó céggel. A háttérben a budapesti reklámpiac összefonódásai és egy igazi „nagykoalíciós” vállalat képe sejlik fel.	','hirek/magyar-hirek/kocsis-a-bkv-neveben-is-alairt-fura-szerzodeseket','2011-11-17 20:53:16','2011-11-17 20:53:16',2,'http://www.k-monitor.hu/hirek/magyar-hirek/kocsis-a-bkv-neveben-is-alairt-fura-szerzodeseket',NULL,NULL,'normal',NULL),(120,'Az MSZP-é a legdrágább, a Fideszé a legnagyobb gépkocsipark','\r\n		Az MSZP képviselőcsoportja használja a legdrágább autókat, a Fidesznek a legnagyobb a gépkocsiparkja. A Jobbik a Skodákra esküszik, amiket bérel,