ure',NULL,NULL,'normal',NULL),(170,'A médiahatóság szóvivőjének volt cége is rendezi a tűzijátékot','\r\n		Nulla volt az árbevétele 2008-ban és 2009-ben annak a Mafracht Kft.-nek, amelyik egy másik céggel, a Pyro-1 Kft.-vel konzorciumot alkotva rendezi az idei tűzijátékot. A Mafracht másik érdekessége, hogy a médiatanács jelenlegi szóvivője, Kiricsi Karola tavaly egy ideig még a társaság ügyvezetője volt.	','hirek/magyar-hirek/a-mediahatosag-szovivojenek-volt-cege-is-rendezi-a-tuzijatekot','2011-11-17 21:03:29','2011-11-17 21:03:29',2,'http://www.k-monitor.hu/hirek/magyar-hirek/a-mediahatosag-szovivojenek-volt-cege-is-rendezi-a-tuzijatekot',NULL,NULL,'normal',NULL),(171,'Újabb Simicska-szerzemény: milliárdok a holdudvarban','\r\n		Egy tevékenységet nem végző budai kft. tűnik a Fidesz-közeli cégbirodalom új gyöngyszemének: megfordult benne mindenki, aki valaha is tett valamit a párt gazdasági hátországa kiépítéséért.	','hirek/magyar-hirek/ujabb-simicska-szerzemeny-milliardok-a-holdudvarban','2011-11-17 21:03:31','2011-11-17 21:03:31',2,'http://www.k-monitor.hu/hirek/magyar-hirek/ujabb-simicska-szerzemeny-milliardok-a-holdudvarban',NULL,NULL,'normal',NULL),(172,'Megszűnik Simicska és Nyerges közös svájci cége','\r\n		Befejezi működését az a svájci cég, amely az első közvetlen üzleti kapcsolatot jelentette a két befolyásos, szoros kormányzati kapcsolatokkal rendelkező magyar üzletember, Simicska Lajos és Nyerges Zsolt között.	','hirek/magyar-hirek/megszunik-simicska-es-nyerges-kozos-svajci-cege','2011-11-17 21:04:40','2011-11-17 21:04:40',2,'http://www.k-monitor.hu/hirek/magyar-hirek/megszunik-simicska-es-nyerges-kozos-svajci-cege',NULL,NULL,'normal',NULL),(173,'Szakértelem tízmillióért','\r\n		Legalább tízmillió forintot kapott szakértői munkákért 2004 és 2007 között Székely Tamás, illetve családi vállalkozása.	','hirek/magyar-hirek/szakertelem-tizmillioert','2011-11-17 21:04:48','2011-11-17 21:04:48',2,'http://www.k-monitor.hu/hirek/magyar-hirek/szakertelem-tizmillioert',NULL,NULL,'normal',NULL),(174,'A Postabank-botránytól a Fradi-pályáig - az MVM-nyomozás egyik kulcsszereplőjének ügyei','\r\n		Feltűnt a neve a Postabank-ügyben, találkozott a Bécsbe menekült Kulcsár Attilával, és fontos pozíciót tölt be a zavaros helyzetű ferencvárosi focicsapatnál Szász András, akit szerdán az MVM szövevényes offshore-ügyletei miatt gyanúsítottként hallgattak ki. Korábban több tízmilliós csalással gyanúsították, és nemzetközi elfogatóparancsot is adtak ki ellene, de jogerősen nem ítélték el.	','hirek/magyar-hirek/a-postabank-botranytol-a-fradi-palyaig-az-mvm-nyomozas-egyik-kulcsszereplojenek-ugyei','2011-11-17 21:04:53','2011-11-17 21:04:53',2,'http://www.k-monitor.hu/hirek/magyar-hirek/a-postabank-botranytol-a-fradi-palyaig-az-mvm-nyomozas-egyik-kulcsszereplojenek-ugyei',NULL,NULL,'normal',NULL),(175,'Lázár János kidobott egy fél házat a múzeumra','\r\n		Szűkös lehet a közvetlen haszna azoknak a több százmilliót érő reklámbannereknek, amikért Hódmezővásárhely egy volt iskolaépületet adott cserébe egy helyi vállalkozónak.	','hirek/magyar-hirek/lazar-janos-kidobott-egy-fel-hazat-a-muzeumra','2011-11-17 21:05:05','2011-11-17 21:05:05',2,'http://www.k-monitor.hu/hirek/magyar-hirek/lazar-janos-kidobott-egy-fel-hazat-a-muzeumra',NULL,NULL,'normal',NULL),(176,'Újabb gyanúsított az MVM-ügyben','\r\n		A Nemzeti Nyomozó Iroda szerdán délután gyanúsítottként hallgatta ki Szász Andrást.	','hirek/magyar-hirek/ujabb-gyanusitott-az-mvm-ugyben','2011-11-17 21:05:12','2011-11-17 21:05:12',2,'http://www.k-monitor.hu/hirek/magyar-hirek/ujabb-gyanusitott-az-mvm-ugyben',NULL,NULL,'normal',NULL),(177,'Jelentéstelenség','\r\n		„Kihalás” előtt állnak a parlamenti vizsgálóbizottságok a kormányzat elszámoltatási akciói és az ellenzék bénultsága miatt.	','hirek/magyar-hirek/jelentestelenseg','2011-11-17 21:05:17','2011-11-17 21:05:17',2,'http://www.k-monitor.hu/hirek/magyar-hirek/jelentestelenseg',NULL,NULL,'normal',NULL),(178,'Drága doktor úr','\r\n		Politikai vihart