-17 21:07:22','2011-11-17 21:07:22',2,'http://www.k-monitor.hu/hirek/magyar-hirek/nem-fizetett-a-vallalkozo',NULL,NULL,'normal',NULL),(194,'Versenytársak nélkül nyert újabb állami megbízást Pintér Sándor korábbi cége','\r\n		Újabb közbeszerzést nyert meg a jelenlegi belügyminiszter, Pintér Sándor korábbi cége, a Civil Biztonsági Szolgálat és egy vele induló másik vállalkozás. A CBSZ és a Sped-Ker-Trans egyedüliként tett ajánlatot az Egészségügyi Készletgazdálkodási Intézet (EKI) ajánlatkérésére, amelyen csak az intézet által felkért cégek indulhattak.	','hirek/magyar-hirek/versenytarsak-nelkul-nyert-ujabb-allami-megbizast-pinter-sandor-korabbi-cege','2011-11-17 21:07:28','2011-11-17 21:07:28',2,'http://www.k-monitor.hu/hirek/magyar-hirek/versenytarsak-nelkul-nyert-ujabb-allami-megbizast-pinter-sandor-korabbi-cege',NULL,NULL,'normal',NULL),(195,'Draskovics szerint nem hallgatták meg tanúként','\r\n		Draskovics Tibor volt pénzügyminiszter kedden tagadta, hogy tanúként hallgatták volna meg egy 48 milliós, a paksi atomerőműnek készült tanulmány ügyében.	','hirek/magyar-hirek/draskovics-szerint-nem-hallgattak-meg-tanukent','2011-11-17 21:07:33','2011-11-17 21:07:33',2,'http://www.k-monitor.hu/hirek/magyar-hirek/draskovics-szerint-nem-hallgattak-meg-tanukent',NULL,NULL,'normal',NULL),(196,'Vadai kiakadt: „Maguknak elgurult a gyógyszere”? + Videó','\r\n		Csalás és más bűncselekmények gyanújával nyomoz a rendőrség az MSZP-s Vadai Ágnes férje szerződésének ügyében.	','hirek/magyar-hirek/vadai-kiakadt-amaguknak-elgurult-a-gyogyszerea-video','2011-11-17 21:07:36','2011-11-17 21:07:36',2,'http://www.k-monitor.hu/hirek/magyar-hirek/vadai-kiakadt-amaguknak-elgurult-a-gyogyszerea-video',NULL,NULL,'normal',NULL),(197,'A Metropolnak írt ki tendert a MüPa','\r\n		A Káel Csaba vezette Művészetek Palotája olyan offline és online médiafelületek vásárlására írt ki tendert, amelyen csak a nemrégiben Simicska Lajos üzletember érdekeltségébe került Metropol nyerhet.	','hirek/magyar-hirek/a-