monitor.hu/hirek/magyar-hirek/a-metropolban-hirdetne-a-mupa',NULL,NULL,'normal',NULL),(202,'Gyanúsítottból tanú lett Földesi-Szabó László','\r\n		Gyanúsítottból tanúvá lépett vissza Földesi-Szabó László! A Blikk információi szerint a volt alapítványi vezér aktája a Központi Nyomozó Főügyészségtől átkerült a Katonai Ügyészségre, azaz nyilvánvaló a kémbotránnyal való kapcsolat.	','hirek/magyar-hirek/gyanusitottbol-tanu-lett-foldesi-szabo-laszlo','2011-11-17 21:07:46','2011-11-17 21:07:46',2,'http://www.k-monitor.hu/hirek/magyar-hirek/gyanusitottbol-tanu-lett-foldesi-szabo-laszlo',NULL,NULL,'normal',NULL),(203,'Az ügyészség Földesi-Szabó mellett. Megalkudtak?','\r\n		Szokatlan módon maga az ügyészség is kérte az Egymásért Egy-Másért Alapítvány csempészetért első fokon hét évre elítélt kurátora, Földesi-Szabó László házi őrizetbe helyezését. A hatóság indítványának szövege pedig – a hvg.hu tudomása szerint – a védőével igencsak megegyezik.	','hirek/magyar-hirek/az-ugyeszseg-foldesi-szabo-mellett-megalkudtak','2011-11-17 21:07:49','2011-11-17 21:07:49',2,'http://www.k-monitor.hu/hirek/magyar-hirek/az-ugyeszseg-foldesi-szabo-mellett-megalkudtak',NULL,NULL,'normal',NULL),(204,'Simicska és Nyerges svájci bázisa és különös ügyei','\r\n		Lapunk kutatásai szerint ugyanazon a svájci címen jegyezték be Simicska Lajos és Nyerges Zsolt „Fidesz-közeli” vállalkozók közös cégét, mint a vörösiszap-mentesítés állami pénzeiben részesülő egyik vállalkozás egykori ismeretlen tulajdonosát. Svájc nem klasszikus offshore-színhely, de a tulajdonos ott is könnyen árnyékban maradhat. A lehetőséget a Fidesz állítólagos gazdasági holdudvara is kihasználja.	','hirek/magyar-hirek/simicska-es-nyerges-svajci-bazisa-es-kulonos-ugyei','2011-11-17 21:07:52','2011-11-17 21:07:52',2,'http://www.k-monitor.hu/hirek/magyar-hirek/simicska-es-nyerges-svajci-bazisa-es-kulonos-ugyei',NULL,NULL,'normal',NULL),(205,'Offshore-cégek játszótere a magyar labdarúgás','\r\n		Ciprus, Hollandia, Jersey, Liechtenstein, Seychelles-szigetek, Svájc, USA: közvetlenül vagy áttételeken keresztül ezekben az országokban bejegyzett, offshore vagy offshore-jellegű cégek szerepelnek több magyar első osztályú labdarúgóklubot működtető cég tulajdonosai között.	','hirek/magyar-hirek/offshore-cegek-jatszotere-a-magyar-labdarugas','2011-11-17 21:09:44','2011-11-17 21:09:44',2,'http://www.k-monitor.hu/hirek/magyar-hirek/offshore-cegek-jatszotere-a-magyar-labdarugas',NULL,NULL,'normal',NULL),(206,'Orbán visszavonta a rendeletet: mi lesz a népszámlálással?','\r\n		Visszavonta a miniszterelnök azt a kormányrendeletet, ami a népszámlálási adatok elektronikus bevitelének költségeire irányzott volna elő 2,5 milliárd forintot. A döntésre a KIM nem adott konkrét magyarázatot; informátoraink túlzónak tartják az összeg nagyságát, és több szcenáriót is felvázoltak a lépés lehetséges okairól.	','hirek/magyar-hirek/orban-visszavonta-a-rendeletet-mi-lesz-a-nepszamlalassal','2011-11-17 21:09:52','2011-11-17 21:09:52',2,'http://www.k-monitor.hu/hirek/magyar-hirek/orban-visszavonta-a-rendeletet-mi-lesz-a-nepszamlalassal',NULL,NULL,'normal',NULL),(207,'Hibázott, megbüntették az NFÜ-t','\r\n		A jogorvoslat bejelenése után kötötte meg a szerződést az érvénytelen ajánlatot tett nyertessel az elektronikus aláírás tenderen, ezért 500 ezer forintra bírságolta a Nemzeti Fejlesztési Ügynökséget a Közbeszerzési Döntőbizottság.	','hirek/magyar-hirek/hibazott-megbuntettek-az-nfu-t','2011-11-17 21:09:58','2011-11-17 21:09:58',2,'http://www.k-monitor.hu/hirek/magyar-hirek/hibazott-megbuntettek-az-nfu-t',NULL,NULL,'normal',NULL),(208,'Újabb mutyi – 160 millió forintos támogatás miatt nyomoznak','\r\n		Különösen nagy vagyoni hátrányt okozó hűtlen kezelés gyanúja miatt nyomozást rendelt el a Központi Nyomozó Főügyészség (KNYF) azzal kapcsolatban, hogy az előző ciklusban Sós Tamás (MSZP) utasítására 160 millió forintot utaltak át az egri Markhot Ferenc Kórházat működtető kft.-nek.	','hirek/magyar-hirek/ujabb-mutyi-a-160-millio-forinto