/tanukent-idezte-be-vadai-agnest-a-katonai-ugyeszseg',NULL,NULL,'normal',NULL),(239,'Kémgate-vizsgálatok a katonai szolgálatoknál','\r\n		Nemcsak a Nemzetbiztonsági Hivatal adatai kerülhettek külsős vállalkozások kezébe az előző ciklus idején, működhettek civil cégek a hazai katonai titkosszolgálatoknál is.	','hirek/magyar-hirek/kemgate-vizsgalatok-a-katonai-szolgalatoknal','2011-11-17 21:13:26','2011-11-17 21:13:26',2,'http://www.k-monitor.hu/hirek/magyar-hirek/kemgate-vizsgalatok-a-katonai-szolgalatoknal',NULL,NULL,'normal',NULL),(240,'Kiemelt ügynek számít a Kolompár-per','\r\n		Mivel kiemelt ügyekben nem telhet el két hónapnál hosszabb idő két tárgyalás között, a nyári ítélkezési szünetben is folytatódik a bizonyítási eljárás Kolompár Orbán és társai ügyében.	','hirek/magyar-hirek/kiemelt-ugynek-szamit-a-kolompar-per','2011-11-17 21:13:35','2011-11-17 21:13:35',2,'http://www.k-monitor.hu/hirek/magyar-hirek/kiemelt-ugynek-szamit-a-kolompar-per',NULL,NULL,'normal',NULL),(241,'Túlbuzgó volt a főnyomozó? Gyanúsított lett a pécsi vesztegetési ügyben','\r\n		Bő egy éve tart a nyomozás a Pécsi Tudományegyetemen (PTE) kitört vesztegetési botránnyal kapcsolatban, amelynek kezdetén kommandósok fogták el Imhof Gábort, az egyetem volt gazdasági főigazgatóját és tanácsadóját, V. Bálintot. Váratlan fordulatként a nyomozás korábbi vezetője, Váradi Csaba alezredes is gyanúsított lett.	','hirek/magyar-hirek/tulbuzgo-volt-a-fonyomozo-gyanusitott-lett-a-pecsi-vesztegetesi-ugyben','2011-11-17 21:13:43','2011-11-17 21:13:43',2,'http://www.k-monitor.hu/hirek/magyar-hirek/tulbuzgo-volt-a-fonyomozo-gyanusitott-lett-a-pecsi-vesztegetesi-ugyben',NULL,NULL,'normal',NULL),(242,'Halmozódnak a \'családbarát\' fideszes kormányzati állások','\r\n		Miközben az ország szegénységgel leginkább sújtott északkeleti vidékén lassan ennivalóra sem jut, a kormánypártok pofátlanul szórják a pénzt, persze saját magukra – állítja az MSZP.	','hirek/magyar-hirek/halmozodnak-a-csaladbarat-fideszes-kormanyzati-allasok','2011-11-17 21:13:48','2011-11-17 21:13:48',2,'http://www.k-monitor.hu/hirek/magyar-hirek/halmozodnak-a-csaladbarat-fideszes-kormanyzati-allasok',NULL,NULL,'normal',NULL),(243,'Kolompár Orbán is élőben akar szerepelni a hírTV-ben + Videó','\r\n		Kitért a kiskunmajsai szakértői munkájával kapcsolatos kérdések elől Kolompár Orbán. Az OCÖ egykori vezetője a Hír Televízió kérdésére sem akarta elárulni, hogy Kiskunmajsa önkormányzata milyen tanácsadásért fizetett az egykori cigány vezetőnek bruttó 100 ezer forintot.	','hirek/magyar-hirek/kolompar-orban-is-eloben-akar-szerepelni-a-hirtv-ben-video','2011-11-17 21:13:48','2011-11-17 21:13:48',2,'http://www.k-monitor.hu/hirek/magyar-hirek/kolompar-orban-is-eloben-akar-szerepelni-a-hirtv-ben-video',NULL,NULL,'normal',NULL),(244,'Az aprópénzig jutottak csak eddig a sokmilliárdos MVM-ügy nyomozói','\r\n		Egy 40 milliós tanulmány ügyében született meg az első gyanúsítás az MVM-ügyben, pedig a Kocsis István vezetése alatt kötött, a cég által is gyanúsnak talált szerződések értéke tízmilliárdokra rúg. Az [origo] összegyűjtötte, eddig mit lehet tudni az MVM offshore-ügyleteiről.	','hirek/magyar-hirek/az-apropenzig-jutottak-csak-eddig-a-sokmilliardos-mvm-ugy-nyomozoi','2011-11-17 21:13:49','2011-11-17 21:13:49',2,'http://www.k-monitor.hu/hirek/magyar-hirek/az-apropenzig-jutottak-csak-eddig-a-sokmilliardos-mvm-ugy-nyomozoi',NULL,NULL,'normal',NULL),(245,'Nincsenek játékszabályok','\r\n		Meglepő, hogy a már többször feljelentett Kopaszi-gát ügy mellékszála eljutott a vádemelésig, hiszen az egész egy blöff, a vádakat pedig a nyomozati iratok sem támasztják alá - mondta lapunknak Újbuda volt alpolgármestere.	','hirek/magyar-hirek/nincsenek-jatekszabalyok','2011-11-17 21:14:09','2011-11-17 21:14:09',2,'http://www.k-monitor.hu/hirek/magyar-hirek/nincsenek-jatekszabalyok',NULL,NULL,'normal',NULL),(246,'Elképesztő ajánlattal akart mutyizni a szocialista polgármester + Videó','\r\n		Bizottsági elnöki és alelnöki, valamint tanácsnoki pozíciókat, és egy igazgatótanácsi státuszt kínált fel Schwartz Béla, Ajka szocialista polgármestere a városi Fidesz-KDNP-frakció tagjainak, ha az Állami Számvevőszéknél elérik az önkormányzatnál végzett vizsgálat leállítását.	','hirek/magyar-hirek/elkepeszto-ajanlattal-akart-mutyizni-a-szocialista-polgarmester-video','2011-11-17 21:14:14','2011-11-17 21:14:14',2,'http://www.k-monitor.hu/hirek/magyar-hirek/elkepeszto-ajanlattal-akart-mutyizni-a-szocialista-polgarmester-video',NULL,NULL,'normal',NULL),(247,'Pereljük az MVM-et, és megint szivárogtatunk','\r\n		Az atlatszo.hu indulásakor beszámoltunk arról, hogy az LMP által indított per nyomán milyen hiányosan adta ki az MVM a korábbi évek gyanús ügyleteiről készült belső jelentéseit.	','hirek/magyar-hirek/pereljuk-az-mvm-et-es-megint-szivarogtatunk','2011-11-17 21:14:18','2011-11-17 21:14:18',2,'http://www.k-monitor.hu/hirek/magyar-hirek/pereljuk-az-mvm-et-es-megint-szivarogtatunk',NULL,NULL,'normal',NULL),(248,'Kisfőnök lett az államtitkár unokatestvére','\r\n		Újabb politikusrokonra bukkant a Blikk az állami szférában! A Nemzeti Fejlesztési Minisztérium helyettes államtitkárának, Olajos Péternek unokatestvére, Olajos Zoltán egy, a tárca irányítása alá tartozó állami cégnél kapott jól fizető állást.	','hirek/magyar-hirek/kisfonok-lett-az-allamtitkar-unokatestvere','2011-11-17 21:14:23','2011-11-17 21:14:23',2,'http://www.k-monitor.hu/hirek/magyar-hirek/kisfonok-lett-az-allamtitkar-unokatestvere',NULL,NULL,'normal',NULL),(249,'Figyelő: A titok szaga','\r\n		Vasra verve viszik el a volt titokminisztert. Az miért nem titok, hogy elviszik? Egyáltalán: mi itt a titok? És ami kiszivárog, az titok? És felelős (kinek felelős, vagy használ?) az, aki a titok morzsáit kiszivárogtatta?	','hirek/magyar-hirek/figyelo-a-titok-szaga','2011-11-17 21:14:25','2011-11-17 21:14:25',2,'http://www.k-monitor.hu/hirek/magyar-hirek/figyelo-a-titok-szaga',NULL,NULL,'normal',NULL),(250,'Feljelentette a gyöngyöspatai polgármester Balázs Józsefet','\r\n		Juhász Oszkár gyöngyöspatai jobbikos polgármester feljelentette a Központi Nyomozó Főügyészségen Balázs Józsefet egy rögzített telefonbeszélgetés miatt, amelyen a fideszes képviselő szerinte megfenyegette Gyöngyöspatát.	','hirek/magyar-hirek/feljelentette-a-gyongyospatai-polgarmester-balazs-jozsefet','2011-11-17 21:14:29','2011-11-17 21:14:29',2,'http://www.k-monitor.hu/hirek/magyar-hirek/feljelentette-a-gyongyospatai-polgarmester-balazs-jozsefet',NULL,NULL,'normal',NULL),(251,'Még mindig nincs elég ügyvédje Orbán miniszterének','\r\n		Hiába hatszorozódtak meg a Nemzeti Fejlesztési Minisztérium ügyvédi költségei, Fellegi Tamásnak úgy tűnik, még mindig nincs elég ügyvédje. Most újabb szerződést kötött egy irodával.	','hirek/magyar-hirek/meg-mindig-nincs-eleg-ugyvedje-orban-miniszterenek','2011-11-17 21:14:31','2011-11-17 21:14:31',2,'http://www.k-monitor.hu/hirek/magyar-hirek/meg-mindig-nincs-eleg-ugyvedje-orban-miniszterenek',NULL,NULL,'normal',NULL),(252,'Pártkötődésű céggel képzik magukat közpénzből a parlamenti szocialisták','\r\n		Többek között a parlamenti hozzászólásokra és problémamegoldásra fogja képezni egy cég a parlament szocialista frakciójának tagjait. A közpénzből fizetett megbízást egy olyan cég nyerte el, amelynek honlapja nincs és tavaly nulla forint bevétele volt, tulajdonosa ugyanakkor kötődik az MSZP-hez.	','hirek/magyar-hirek/partkotodesu-ceggel-kepzik-magukat-kozpenzbol-a-parlamenti-szocialistak','2011-11-17 21:14:32','2011-11-17 21:14:32',2,'http://www.k-monitor.hu/hirek/magyar-hirek/partkotodesu-ceggel-kepzik-magukat-kozpenzbol-a-parlamenti-szocialistak',NULL,NULL,'normal',NULL),(253,'Már nyomoznak a péti ügyben','\r\n		Hivatali visszaélés és más bűncselekmények gyanújával vizsgálja a péti Nitrogénművek Zrt.-nek 2008–2009-ben nyújtott állami hitelgarancia és kezességvállalás ügyét a Központi Nyomozó Főügyészség – tudtuk meg Fazekas Gézától.	','hirek/magyar-hirek/mar-nyomoznak-a-peti-ugyben','2011-11-17 21:14:35','2011-11-17 21:14:35',2,'http://www.k-monitor.hu/hirek/magyar-hirek/mar-nyomoznak-a-peti-ugyben',NULL,NULL,'normal',NULL),(254,'Tarlós aláírta az új metrókocsi-szerződést az Alstommal','\r\n		A ciklus legnagyobb sikerének nevezte Tarlós István főpolgármester, hogy szerdán aláírták az új metrókocsikról szóló megállapodást a francia Alstom elnök-vezérigazgatójával. Patrick Kron az aláírás után azt mondta, nem lesz gond a típusengedély megszerzése a Nemzeti Közlekedési Hatóságtól.	','hirek/magyar-hirek/tarlos-alairta-az-uj-metrokocsi-szerzodest-az-alstommal','2011-11-17 21:14:37','2011-11-17 21:14:37',2,'http://www.k-monitor.hu/hirek/magyar-hirek/tarlos-alairta-az-uj-metrokocsi-szerzodest-az-alstommal',NULL,NULL,'normal',NULL),(255,'Valami bűzlik','\r\n		Még nem tudni, előre kitervelten, vagy a válság okozta kényszerben tüntette el a műtrágyapiac egykori nagyvada, a Kontirex Kft. két banki kereskedőház több milliárd forintnyi áruját.	','hirek/magyar-hirek/valami-buzlik','2011-11-17 21:14:42','2011-11-17 21:14:42',2,'http://www.k-monitor.hu/hirek/magyar-hirek/valami-buzlik',NULL,NULL,'normal',NULL),(256,'MagyarLeaks: Kreatív könyvelés az MVM-nél','\r\n		Különösen nagy vagyoni hátrányt okozó hűtlen kezelés miatt gyanúsítottként hallgatta ki a Paksi Atomerőmű Zrt. és a Magyar Villamos Művek Zrt. (MVM) korábbi gazdasági vezérigazgató-helyettesét a rendőrség.	','hirek/magyar-hirek/magyarleaks-kreativ-konyveles-az-mvm-nel','2011-11-17 21:14:44','2011-11-17 21:14:44',2,'http://www.k-monitor.hu/hirek/magyar-hirek/magyarleaks-kreativ-konyveles-az-mvm-nel',NULL,NULL,'normal',NULL),(257,'Bennfentes nyertesek a Nemzeti Fejlesztési Ügynökségnél?','\r\n		Valóban voltak problémák azon pályázaton, amelyen a választások előtt közel százharmincmillió forintot nyert az előző kormányhoz közel álló hat szervezet, így a Magyar Szakszervezetek Országos Szövetsége is.	','hirek/magyar-hirek/bennfentes-nyertesek-a-nemzeti-fejlesztesi-ugynoksegnel','2011-11-17 21:14:45','2011-11-17 21:14:45',2,'http://www.k-monitor.hu/hirek/magyar-hirek/bennfentes-nyertesek-a-nemzeti-fejlesztesi-ugynoksegnel',NULL,NULL,'normal',NULL),(258,'Oroszkém-kockák','\r\n		Lapunk már tavaly két lábon járó nemzetbiztonsági kockázatként azonosította a mostani kémügy csuklyás gyanúsítottját, Püski Lászlót. Úgy tudjuk, Szilvásy Györgyék az általa gründolt Zömök Kft.-vel szűrették volna ki az NBH-ba beépült \"fideszeseket\". Az orosz érdekű cég titkosszolgálati adatok mellett kormányzati, rendőrségi és repülőtéri információkhoz is hozzáfért.	','hirek/magyar-hirek/oroszkem-kockak','2011-11-17 21:14:46','2011-11-17 21:14:46',2,'http://www.k-monitor.hu/hirek/magyar-hirek/oroszkem-kockak',NULL,NULL,'normal',NULL),(259,'Gyanúsított a volt paksi vezérhelyettes','\r\n		Hűtlen kezeléssel gyanúsítja Molnár Lászlót, a Magyar Villamos Művek (MVM) és a paksi atomerőmű korábbi vezérigazgató-helyettesét a rendőrség - hangzott el kedden a MR1-Kossuth rádió Krónika című hírműsorában.	','hirek/magyar-hirek/gyanusitott-a-volt-paksi-vezerhelyettes','2011-11-17 21:15:14','2011-11-17 21:15:14',2,'http://www.k-monitor.hu/hirek/magyar-hirek/gyanusitott-a-volt-paksi-vezerhelyettes',NULL,NULL,'normal',NULL),(260,'Mellőzik a nyomozást a sorsdöntő közokirat-hamisítás ügyében','\r\n		A rendőrség megállapította, hogy az Emfesz gázszolgáltatót 2009-ben eltulajdonították, amikor egy dollárért adták el, és az is kiderült, hogy az ügylet lebonyolítása alkalmas lenne a közokirat-hamisítás bűntettének megállapítására.	','hirek/magyar-hirek/mellozik-a-nyomozast-a-sorsdonto-kozokirat-hamisitas-ugyeben','2011-11-17 21:15:14','2011-11-17 21:15:14',2,'http://www.k-monitor.hu/hirek/magyar-hirek/mellozik-a-nyomozast-a-sorsdonto-kozokirat-hamisitas-ugyeben',NULL,NULL,'normal',NULL),(261,'Állami lakásokat kapnak a fideszes hivatalnokok','\r\n		Hivatali lakást adna a zömében fideszes pártállású kormánymegbízottaknak - a miniszterekhez és az államtitkárokhoz hasonlóan - a kormány. A július 18-án elfogadott kormányrendelet ismét bevezeti az állami vezetők számára a VIP-kórház intézményét is.	','hirek/magyar-hirek/allami-lakasokat-kapnak-a-fideszes-hivatalnokok','2011-11-17 21:15:20','2011-11-17 21:15:20',2,'http://www.k-monitor.hu/hirek/magyar-hirek/allami-lakasokat-kapnak-a-fideszes-hivatalnokok',NULL,NULL,'normal',NULL),(262,'Orbán-bányák: Megtört a csönd','\r\n		A második Orbán-kormány hivatalba lépése óta – a zalai tőzeglápok kitermelésének jogszerűségével összefüggésben – most először bukkantak fel a médiában a miniszterelnök családjának tulajdonában lévő bányavállalkozások.	','hirek/magyar-hirek/orban-banyak-megtort-a-csond','2011-11-17 21:15:22','2011-11-17 21:15:22',2,'http://www.k-monitor.hu/hirek/magyar-hirek/orban-banyak-megtort-a-csond',NULL,NULL,'normal',NULL),(263,'BKV-ügy: végéhez közeledik a nyomozás','\r\n		Hamarosan befejeződik az eddig 18 gyanúsítottat \"felvonultatott\" BKV-s botrány csaknem két évvel ezelőtt kezdett nyomozása - tudtuk meg.	','hirek/magyar-hirek/bkv-ugy-vegehez-kozeledik-a-nyomozas','2011-11-17 21:15:29','2011-11-17 21:15:29',2,'http://www.k-monitor.hu/hirek/magyar-hirek/bkv-ugy-vegehez-kozeledik-a-nyomozas',NULL,NULL,'normal',NULL),(264,'Itt nyaralhat a Balatonnál Szijjártó és Mesterházy','\r\n		Jó előre gondoltak a pihenőre a vezető magyar politikusok. Befészkelték magukat a Balaton környékére.	','hirek/magyar-hirek/itt-nyaralhat-a-balatonnal-szijjarto-es-mesterhazy','2011-11-17 21:15:49','2011-11-17 21:15:49',2,'http://www.k-monitor.hu/hirek/magyar-hirek/itt-nyaralhat-a-balatonnal-szijjarto-es-mesterhazy',NULL,NULL,'normal',NULL),(265,'Balsai a kormányra mutogat','\r\n		Az eredeti \"törvényjavaslatot az Országgyűlésnek benyújtó Nemzetgazdasági Minisztérium illetékes szakmai osztályai működtek közre\" annak a módosításnak a szövegezésében, amely az utolsó pillanatban kivette a pénzügyi salátatörvényből a dohánytermékek jövedéki adójának emelésére vonatkozó passzusokat.	','hirek/magyar-hirek/balsai-a-kormanyra-mutogat','2011-11-17 21:16:02','2011-11-17 21:16:02',2,'http://www.k-monitor.hu/hirek/magyar-hirek/balsai-a-kormanyra-mutogat',NULL,NULL,'normal',NULL),(266,'MagyarLeaks: A sokmilliárdos sávolyi spanyol földspekuláció strómanjai','\r\n		Sávoly önkormányzata tavaly év végén belterületbe vonta a spanyol beruházók által félig elkészített gyorsaságimotoros-versenypálya 196 hektáros területét, majd januártól telekadót vezetett be, amely után közel 200 millió forintnyi adóbevétellel számol – nyilatkozta Bobek József, Sávoly polgármestere az MTI-nek múlt csütörtökön.	','hirek/magyar-hirek/magyarleaks-a-sokmilliardos-savolyi-spanyol-foldspekulacio-stromanjai','2011-11-17 21:16:04','2011-11-17 21:16:04',2,'http://www.k-monitor.hu/hirek/magyar-hirek/magyarleaks-a-sokmilliardos-savolyi-spanyol-foldspekulacio-stromanjai',NULL,NULL,'normal',NULL),(267,'Pintér Sándor bőrére ment az Eclipse-ügy?','\r\n		Kormányzati körökben is értetlenül állnak az Eclipse-nyomozás fejleményei előtt: hogyan robbanhatott ekkorát a Pintér Sándor belügyminiszter lányának munkahelyét érintő vizsgálat, és miért pont a kormánypárti sajtó járt élen az ügy kiteregetésében.	','hirek/magyar-hirek/pinter-sandor-borere-ment-az-eclipse-ugy','2011-11-17 21:16:05','2011-11-17 21:16:05',2,'http://www.k-monitor.hu/hirek/magyar-hirek/pinter-sandor-borere-ment-az-eclipse-ugy',NULL,NULL,'normal',NULL),(268,'Vádat emeltek Molnár Gyula és Lakos Imre ellen','\r\n		A Központi Nyomozó Főügyészség tegnap vádat emelt Molnár Gyula volt XI.kerületi szocialista polgármester és Lakos Imre korábbi SZDSZ-es alpolgármester ellen hivatali visszaélés miatt - írja a Magyar Nemzet.	','hirek/magyar-hirek/vadat-emeltek-molnar-gyula-es-lakos-imre-ellen','2011-11-17 21:16:22','2011-11-17 21:16:22',2,'http://www.k-monitor.hu/hirek/magyar-hirek/vadat-emeltek-molnar-gyula-es-lakos-imre-ellen',NULL,NULL,'normal',NULL),(269,'Szilvásy és Laborc szabad maradt','\r\n		Elrendelte a Fővárosi Ítélőtábla Katonai Tanácsa Galambos Lajos előzetes letartóztatását, Szilvásy György és Laborc Sándor esetében viszont helyben hagyta a korábbi döntést, amely nem rendelt el kényszerintézkedést a gyanúsítottakkal szemben.	','hirek/magyar-hirek/szilvasy-es-laborc-szabad-maradt-1','2011-11-17 21:16:33','2011-11-17 21:16:33',2,'http://www.k-monitor.hu/hirek/magyar-hirek/szilvasy-es-laborc-szabad-maradt-1',NULL,NULL,'normal',NULL),(270,'Lázár: Sok pénzt lehet keresni az MVM-mel','\r\n		Nagyobb függetlenséget adnának a Magyar Nemzeti Banknak (MNB) – mondta Lázár János, a Fidesz frakcióvezetője egy interjúban a Bloomberg hírügynökségnek. A kormány csökkentené az egyes iparágakra kivetett különadókat is, és nagy üzletet látnak az MVM-ben.	','hirek/magyar-hirek/lazar-sok-penzt-lehet-keresni-az-mvm-mel','2011-11-17 21:16:38','2011-11-17 21:16:38',2,'http://www.k-monitor.hu/hirek/magyar-hirek/lazar-sok-penzt-lehet-keresni-az-mvm-mel',NULL,NULL,'normal',NULL),(271,'Szokatlan indoklással szüntették meg az Emfesz-nyomozást','\r\n		A Nemzeti Nyomozó Iroda júniusban megszüntette a nyomozást a hazai gázpiacon korábban még 20 százalékos részesedéssel működő Emfesz 2009-es 1 dolláros eladásával kapcsolatban. Az Index birtokába került rendőrségi határozat szerint a 200 milliárdos forgalmat bonyolító cégről a szakértők kiderítették, hogy piaci értéke akkoriban mínuszban volt, ha pedig értéktelen, akkor hiába tulajdonították el, sikkasztás vagy más vagyon elleni bűncselekmény elkövetése nem állapítható meg.	','hirek/magyar-hirek/szokatlan-indoklassal-szuntettek-meg-az-emfesz-nyomozast','2011-11-17 21:16:40','2011-11-17 21:16:40',2,'http://www.k-monitor.hu/hirek/magyar-hirek/szokatlan-indoklassal-szuntettek-meg-az-emfesz-nyomozast',NULL,NULL,'normal',NULL),(272,'Megint elúszott a CET','\r\n		Tegnap ismét elhalasztották a Közraktárak közé ékelt CET műszaki átadás-átvételének megkezdését. Az önkormányzat szerint a beruházó a hibás. A főváros aggódik. A fejlesztő szerint ez csak újabb időhúzás.	','hirek/magyar-hirek/megint-eluszott-a-cet','2011-11-17 21:16:42','2011-11-17 21:16:42',2,'http://www.k-monitor.hu/hirek/magyar-hirek/megint-eluszott-a-cet',NULL,NULL,'normal',NULL),(273,'Eclipse-ügy: gyanúsított gyanúsítók','\r\n		A Népszabadság értesülése szerint az elmúlt hónapokban bűncselekmények gyanúját is felvető szabálytalanságok és (ha a gyanú megalapozott) egyértelműen bűncselekménynek minősülő manipulációk miatt gyanúsítottként hallgatták ki az Eclipse-ügy nyomozásának kezdetén az ügyben eljáró nyomozócsoport némely vezetőjét és munkatársát.	','hirek/magyar-hirek/eclipse-ugy-gyanusitott-gyanusitok','2011-11-17 21:16:43','2011-11-17 21:16:43',2,'http://www.k-monitor.hu/hirek/magyar-hirek/eclipse-ugy-gyanusitott-gyanusitok',NULL,NULL,'normal',NULL),(274,'Hivatali visszaélés a vád a volt újbudai polgármester ellen','\r\n		A Magyar Nemzet szerint a Központi Nyomozó Főügyészség vádat emelt egy volt önkormányzati terület pályázat nélküli átjátszása miatt Molnár Gyula, Lakos Imre és egy ügyvéd ellen.	','hirek/magyar-hirek/hivatali-visszaeles-a-vad-a-volt-ujbudai-polgarmester-ellen','2011-11-17 21:16:52','2011-11-17 21:16:52',2,'http://www.k-monitor.hu/hirek/magyar-hirek/hivatali-visszaeles-a-vad-a-volt-ujbudai-polgarmester-ellen',NULL,NULL,'normal',NULL),(275,'Vádlottak Újbuda volt vezetői','\r\n		Hivatali visszaélés bűntette miatt Molnár Gyula, a fővárosi XI. kerület volt MSZP-s polgármestere, Lakos Imre korábbi SZDSZ-es alpolgármester és egy ügyvéd ellen vádat emelt csütörtökön a Központi Nyomozó Főügyészség egy volt önkormányzati ingatlan pályázat nélküli magánkézbe juttatása ügyében – tudtuk meg. A szocialista politikus, aki jelenleg fővárosi képviselő, állítja: kifejezetten büszke a kerület korábbi vezetésének tetteire.	','hirek/magyar-hirek/vadlottak-ujbuda-volt-vezetoi','2011-11-17 21:16:55','2011-11-17 21:16:55',2,'http://www.k-monitor.hu/hirek/magyar-hirek/vadlottak-ujbuda-volt-vezetoi',NULL,NULL,'normal',NULL),(276,'EMFESZ-ügy: egy forintot ért a cég?','\r\n			','hirek/magyar-hirek/emfesz-ugy-egy-forintot-ert-a-ceg','2011-11-17 21:16:59','2011-11-17 21:16:59',2,'http://www.k-monitor.hu/hirek/magyar-hirek/emfesz-ugy-egy-forintot-ert-a-ceg',NULL,NULL,'normal',NULL),(277,'Felajánlotta lemondását a belügyi helyettes államtitkár','\r\n		Felajánlotta lemondását Eiselt György, a Belügyminisztérium helyettes államtitkára a tárca vezetőjének, miután az Eclipse-ügy folyományaként hivatali vesztegetéssel gyanúsította meg a Központi Nyomozó Főügyészség.	','hirek/magyar-hirek/felajanlotta-lemondasat-a-belugyi-helyettes-allamtitkar','2011-11-17 21:17:04','2011-11-17 21:17:04',2,'http://www.k-monitor.hu/hirek/magyar-hirek/felajanlotta-lemondasat-a-belugyi-helyettes-allamtitkar',NULL,NULL,'normal',NULL),(278,'\"Fideszes veszélyt\" akartak elhárítani Szilvásyék az NBH-nál','\r\n		A Szilvásy-Galambos-Laborc-féle ügy lényege, hogy az érintettek az orosz érdekűként azonosított Zömök Kft. stábjával szűrették (volna) ki az NBH-ba beépült „fideszeseket\". E cég a szolgálatok személyi adatai mellett más állami információkhoz is hozzáfért.	','hirek/magyar-hirek/fideszes-veszelyt-akartak-elharitani-szilvasyek-az-nbh-nal','2011-11-17 21:17:06','2011-11-17 21:17:06',2,'http://www.k-monitor.hu/hirek/magyar-hirek/fideszes-veszelyt-akartak-elharitani-szilvasyek-az-nbh-nal',NULL,NULL,'normal',NULL),(279,'Nem érintett Heller Ágnes fia','\r\n		Heller Ágnes fia, Fehér György nem érintett az Informatikai Kockázati Tőkealap-kezelő Zrt. ügyében, amelyben Budai Gyula feljelentést tett.	','hirek/magyar-hirek/nem-erintett-heller-agnes-fia','2011-11-17 21:17:10','2011-11-17 21:17:10',2,'http://www.k-monitor.hu/hirek/magyar-hirek/nem-erintett-heller-agnes-fia',NULL,NULL,'normal',NULL),(280,'Eclipse: a bebukott titkoszolgálati cég','\r\n		A Belügyminisztérium helyettes államtitkárának meggyanúsítása ismét ráirányította a figyelmet a már tavaly márciusban kirobbant Eclipse-ügyre. A titkosszolgálati kapcsolatokkal rendelkező cég az elmúlt években több mint 20 milliárd forint állami megbízást kapott, legalább 2 milliárdos adócsalást követett el, fiktív számlákkal pedig akár 12 milliárd forintot tüntethetett el. Vannak a történetben luxusautók, orosz anyanyelvű emberek, és ott van Pintér Sándor lánya is.	','hirek/magyar-hirek/eclipse-a-bebukott-titkoszolgalati-ceg','2011-11-17 21:17:11','2011-11-17 21:17:11',2,'http://www.k-monitor.hu/hirek/magyar-hirek/eclipse-a-bebukott-titkoszolgalati-ceg',NULL,NULL,'normal',NULL),(281,'Tisztuló kép titokügyben','\r\n		A Pintér Sándor belügyminiszter korábbi érdekeltségét, hozzátartozóit is érintő Eclipse-botrányban is szereplő kör ügyei miatt nyomoznak a titkosszolgálat korábbi vezetői ellen.	','hirek/magyar-hirek/tisztulo-kep-titokugyben','2011-11-17 21:18:15','2011-11-17 21:18:15',2,'http://www.k-monitor.hu/hirek/magyar-hirek/tisztulo-kep-titokugyben',NULL,NULL,'normal',NULL),(282,'Orbán apja „elvileg védett” lápon bányászhat','\r\n		A jövő nemzedékek országgyűlési biztosa vizsgálja a Zala megyei Szévíz-völgyi lápterületek körüli jogi anomáliákat, amelyeknek egyik haszonélvezője a kormányfő apjának és fivérének, id. és ifj. Orbán Győzőéknek a cége.	','hirek/magyar-hirek/orban-apja-aelvileg-vedetta-lapon-banyaszhat','2011-11-17 21:18:53','2011-11-17 21:18:53',2,'http://www.k-monitor.hu/hirek/magyar-hirek/orban-apja-aelvileg-vedetta-lapon-banyaszhat',NULL,NULL,'normal',NULL),(283,'Titkos állami megbízásokon kaszáló cég tűnt fel a gyanúsított helyettes államtitkár mögött','\r\n		Milliárdos állami megbízásokat nyert el titokban az elmúlt években az a cég, amelynek az ügyészség szerint köze van Eiselt György, a Belügyminisztérium helyettes államtitkárának vesztegetés miatti meggyanúsításához.	','hirek/magyar-hirek/titkos-allami-megbizasokon-kaszalo-ceg-tunt-fel-a-gyanusitott-helyettes-allamtitkar-mogott','2011-11-17 21:18:58','2011-11-17 21:18:58',2,'http://www.k-monitor.hu/hirek/magyar-hirek/titkos-allami-megbizasokon-kaszalo-ceg-tunt-fel-a-gyanusitott-helyettes-allamtitkar-mogott',NULL,NULL,'normal',NULL),(284,'Ismét \"kirívóan olcsó\" ajánlat ellen nyert Pintér Sándor egykori cégcsoportja','\r\n		A sokadik közbeszerzési eljárását nyerte meg a korábban Pintér Sándor belügyminiszter által tulajdonolt biztonsági cégcsoport, amelynek egyik tagja fogja őrizni mostantól a következő három évben a hazai földgázvezetékrendszert üzemeltető cég létesítményeit.	','hirek/magyar-hirek/ismet-kirivoan-olcso-ajanlat-ellen-nyert-pinter-sandor-egykori-cegcsoportja','2011-11-17 21:19:07','2011-11-17 21:19:07',2,'http://www.k-monitor.hu/hirek/magyar-hirek/ismet-kirivoan-olcso-ajanlat-ellen-nyert-pinter-sandor-egykori-cegcsoportja',NULL,NULL,'normal',NULL),(285,'Tarlós így akarja: mégis nyílt ülésen vitatják meg az Alstom-megállapodást','\r\n		Fővárosi Közgyűlés csütörtöki rendkívüli ülésén több ügyről is döntöttek, köztük a metrókocsikkal kapcsolatos megállapodás tervezetéről.	','hirek/magyar-hirek/tarlos-igy-akarja-megis-nyilt-ulesen-vitatjak-meg-az-alstom-megallapodast','2011-11-17 21:19:32','2011-11-17 21:19:32',2,'http://www.k-monitor.hu/hirek/magyar-hirek/tarlos-igy-akarja-megis-nyilt-ulesen-vitatjak-meg-az-alstom-megallapodast',NULL,NULL,'normal',NULL),(286,'Gyanúsítottként hallgatták ki a Belügyminisztérium helyettes államtitkárát','\r\n		Az MTV Híradójának értesülései szerint hivatali vesztegetéssel gyanúsítja a Belügyminisztérium helyettes államtitkárát, Eiselt Györgyöt a Központi Nyomozó Főügyészség.	','hirek/magyar-hirek/gyanusitottkent-hallgattak-ki-a-belugyminiszterium-helyettes-allamtitkarat','2011-11-17 21:19:34','2011-11-17 21:19:34',2,'http://www.k-monitor.hu/hirek/magyar-hirek/gyanusitottkent-hallgattak-ki-a-belugyminiszterium-helyettes-allamtitkarat',NULL,NULL,'normal',NULL),(287,'Szélesre tárt kiskapuk a közbeszerzésben','\r\n		Több szabadság az ajánlatkérőnek, kevésbé túlszabályozott rendszer – így foglalhatók össze a frissen elfogadott közbeszerzési törvény pozitívumai a téma szakértői szerint. Azzal azonban, hogy lazábbá tették a kereteket, szélesebbre tárták a kiskapukat.	','hirek/magyar-hirek/szelesre-tart-kiskapuk-a-kozbeszerzesben','2011-11-17 21:19:39','2011-11-17 21:19:39',2,'http://www.k-monitor.hu/hirek/magyar-hirek/szelesre-tart-kiskapuk-a-kozbeszerzesben',NULL,NULL,'normal',NULL),(288,'Lázár újraszabályozná a dohánypiacot','\r\n		A Fidesz frakcióvezetője azt mondta: \"Nem akartuk, hogy üzleti érdekek vagy lobbiérdekek érvényesüljenek egy-egy adópolitikai döntés kapcsán\".	','hirek/magyar-hirek/lazar-ujraszabalyozna-a-dohanypiacot','2011-11-17 21:19:39','2011-11-17 21:19:39',2,'http://www.k-monitor.hu/hirek/magyar-hirek/lazar-ujraszabalyozna-a-dohanypiacot',NULL,NULL,'normal',NULL),(289,'Ötmilliárdot sikkaszthatott egy műtrágyás cég','\r\n		A gyanúsítottak a cég ügyvezetésével egy hajléktalant bíztak meg, és a társaságot egy szegényes anyagi körülmények között élő házaspárnak fiktív módon értékesítették.	','hirek/magyar-hirek/otmilliardot-sikkaszthatott-egy-mutragyas-ceg','2011-11-17 21:19:40','2011-11-17 21:19:40',2,'http://www.k-monitor.hu/hirek/magyar-hirek/otmilliardot-sikkaszthatott-egy-mutragyas-ceg',NULL,NULL,'normal',NULL),(290,'Kamikáze képviselők, avagy közbeszerzési szakértők a parlamentben','\r\n		Virtuálisan elárasztották az előterjesztő tárca asztalát azok a képviselői módosító indítványok, amelyek a parlament által tegnap elfogadott közbeszerzési törvény tervezetéhez kapcsolódtak.	','hirek/magyar-hirek/kamikaze-kepviselok-avagy-kozbeszerzesi-szakertok-a-parlamentben','2011-11-17 21:19:40','2011-11-17 21:19:40',2,'http://www.k-monitor.hu/hirek/magyar-hirek/kamikaze-kepviselok-avagy-kozbeszerzesi-szakertok-a-parlamentben',NULL,NULL,'normal',NULL),(291,'Alaposan megvágták Vadai Ágnest','\r\n		Mélyen a zsebébe kell nyúlnia a szocialista Vadai Ágnesnek, egykori honvédelmi államtitkárnak a Szolnoki Munkaügyi Bíróság keddi első fokú ítélete szerint: a verdikt kimondja, hogy az MSZP-s politikus 2007-ben jogellenesen bocsátotta el a képviselői munkatársát.	','hirek/magyar-hirek/alaposan-megvagtak-vadai-agnest','2011-11-17 21:19:43','2011-11-17 21:19:43',2,'http://www.k-monitor.hu/hirek/magyar-hirek/alaposan-megvagtak-vadai-agnest',NULL,NULL,'normal',NULL),(292,'Megkezdődött Tasnádi vesztegetési pere','\r\n		Az előzetes letartóztatásban lévő vállalkozót azzal vádolják, hogy egy ellene folytatott büntetőügyben 3 millió forintot fizetett valótlan tartalmú elmeorvos-szakértői véleményért.	','hirek/magyar-hirek/megkezdodott-tasnadi-vesztegetesi-pere','2011-11-17 21:19:44','2011-11-17 21:19:44',2,'http://www.k-monitor.hu/hirek/magyar-hirek/megkezdodott-tasnadi-vesztegetesi-pere',NULL,NULL,'normal',NULL),(293,'Új tulajok az Electro Worldben','\r\n		A Nemzeti Adó- és Vámhivatal (NAV) hétfőn mindenkinek − a Napi Gazdaságnak is − megerősítette az Electro World (EW) cégcsoport tulajdonosainál és vezetőinél tartott házkutatás tényét, ám a nyomozásra való tekintettel részleteket nem kívánt elárulni. A privatkopo.hu írta meg először, hogy az elektronikai áruházakat működtető lánc több száz millió forintos számlacsalási ügybe keveredett egy Bender-Log Zrt.-n keresztül – a bender log A dzsungel könyvében a majmok népe –, amely a hírek szerint eddig 15 milliárd forint értékben bocsátott ki számlákat, a NAV erről sem kívánt részleteket elárulni.	','hirek/magyar-hirek/uj-tulajok-az-electro-worldben','2011-11-17 21:19:48','2011-11-17 21:19:48',2,'http://www.k-monitor.hu/hirek/magyar-hirek/uj-tulajok-az-electro-worldben',NULL,NULL,'normal',NULL),(294,'Megmutatták erejüket a lobbik','\r\n		Tavasz óta nincs lobbitörvény, a lobbik viszont szép sikereket érnek el. Az őrült tempójú törvényhozási menetben általában az utolsó pillanatban enyhülnek jogszabályok, amelyek megváltoztatásához általában Lázár Jánoson vagy Rogán Antalon át vezet az út.	','hirek/magyar-hirek/megmutattak-erejuket-a-lobbik','2011-11-17 21:20:13','2011-11-17 21:20:13',2,'http://www.k-monitor.hu/hirek/magyar-hirek/megmutattak-erejuket-a-lobbik',NULL,NULL,'normal',NULL),(295,'Brókernet ügy: Fenyegetik vagy figyelmeztetik az újságírót?','\r\n		Zsarolás és más bűncselekmények miatt nyomoz a BRFK szervezett bűnözés elleni osztálya a Brókernet elleni sikeres hackertámadás ügyében. Bár a Brókernet szerkesztőségünknek írt levele szerint egyelőre a „támadás ténye sem nyert bizonyítást”, a rendőrség lefoglalta Bodoky Tamás újságírótól azt a CD-t, amelyen e nem bizonyított támadás során ismeretlenek által ellopott file-okat lementette. Kihallgatásán a rendőrség alig burkoltan megfenyegette a forrását felfedni nem kívánó újságírót.	','hirek/magyar-hirek/brokernet-ugy-fenyegetik-vagy-figyelmeztetik-az-ujsagirot','2011-11-17 21:20:23','2011-11-17 21:20:23',2,'http://www.k-monitor.hu/hirek/magyar-hirek/brokernet-ugy-fenyegetik-vagy-figyelmeztetik-az-ujsagirot',NULL,NULL,'normal',NULL),(296,'Csaltak mezőgazdasági uniós támogatásokkal?','\r\n		Három évvel ezelőtt még nem találtak csalásra utaló nyomot a füzesabonyi rendőrök földalapú támogatások igénylésével kapcsolatban. Most viszont mégis vizsgálják, hogy jogtalanul utaltak-e ki több millió forint uniós támogatást egy aldebrői cégnek.	','hirek/magyar-hirek/csaltak-mezogazdasagi-unios-tamogatasokkal','2011-11-17 21:20:27','2011-11-17 21:20:27',2,'http://www.k-monitor.hu/hirek/magyar-hirek/csaltak-mezogazdasagi-unios-tamogatasokkal',NULL,NULL,'normal',NULL),(297,'\"Nem kémkedés, butaság\"','\r\n		Az Információs Hivatal egykori műveleti igazgatója szerint minden kiszivárogtatás káros a volt titkosszolgálati vezetők ügyében.	','hirek/magyar-hirek/nem-kemkedes-butasag','2011-11-17 21:20:28','2011-11-17 21:20:28',2,'http://www.k-monitor.hu/hirek/magyar-hirek/nem-kemkedes-butasag',NULL,NULL,'normal',NULL),(298,'Népszabadság: Házi őrizetbe került az Egymásért Alapítvány alapítója Bécsben','\r\n		A Népszabadság meg nem erősített információi szerint házi őrizetbe került J. Róbert Bécsben. Az Egymásért lapatívány alapítójának neve a kémbotrány kapcsán is felmerült.	','hirek/magyar-hirek/nepszabadsag-hazi-orizetbe-kerult-az-egymasert-alapitvany-alapitoja-becsben','2011-11-17 21:20:30','2011-11-17 21:20:30',2,'http://www.k-monitor.hu/hirek/magyar-hirek/nepszabadsag-hazi-orizetbe-kerult-az-egymasert-alapitvany-alapitoja-becsben',NULL,NULL,'normal',NULL),(299,'Kémügy: hamarosan jogerős döntés','\r\n		A Magyar Nemzet szerint a hét közepéig kiderül, szabadlábon vagy a rács mögül védekezhetnek-e a kémbotrány gyanúsítottjai.	','hirek/magyar-hirek/kemugy-hamarosan-jogeros-dontes','2011-11-17 21:20:34','2011-11-17 21:20:34',2,'http://www.k-monitor.hu/hirek/magyar-hirek/kemugy-hamarosan-jogeros-dontes',NULL,NULL,'normal',NULL),(300,'Galambos ügyvédje sem tudja, mit tehetett P. László','\r\n		Galambos Lajos, az NBH volt főigazgatójának védője sem tudja, hogy mivel gyanúsítják a kémügy negyedik érintettjét, P. Lászlót. Molnár Lajos azt mondta: az eljárás során nem találkozott a nevével, pedig – szerinte – a terhelt neve nem lehet államtitok.	','hirek/magyar-hirek/galambos-ugyvedje-sem-tudja-mit-tehetett-p-laszlo','2011-11-17 21:20:40','2011-11-17 21:20:40',2,'http://www.k-monitor.hu/hirek/magyar-hirek/galambos-ugyvedje-sem-tudja-mit-tehetett-p-laszlo',NULL,NULL,'normal',NULL),(301,'Lendvai egy nagy lejáratóakció kezdetét látja benne','\r\n		A honvédelmi miniszter azt állítja, a kormányváltáskor nem ismert olyan iratot, amelyeket még a szocialista kormány idején az NBH titkosított. A szocialisták lejáratóakciónak tartják a volt NBH-s vezetők és Szilvásy György ellen indított eljárást.	','hirek/magyar-hirek/lendvai-egy-nagy-lejaratoakcio-kezdetet-latja-benne','2011-11-17 21:20:45','2011-11-17 21:20:45',2,'http://www.k-monitor.hu/hirek/magyar-hirek/lendvai-egy-nagy-lejaratoakcio-kezdetet-latja-benne',NULL,NULL,'normal',NULL),(302,'Elszámolták - 100 millióval többe kerül a váci főtér','\r\n		Az eredetileg becsült nettó 560 millió forinttal szemben nettó 664 millió forintért vállalták a CR-VÁC közös ajánlattevők a Vác Főutca-Főtér program II/1. ütemének a kivitelezését.	','hirek/magyar-hirek/elszamoltak-100-millioval-tobbe-kerul-a-vaci-foter','2011-11-17 21:20:45','2011-11-17 21:20:45',2,'http://www.k-monitor.hu/hirek/magyar-hirek/elszamoltak-100-millioval-tobbe-kerul-a-vaci-foter',NULL,NULL,'normal',NULL),(303,'Visszadobta a BRFK az LMP feljelentését','\r\n		Elutasította a rendőrség az LMP frakcióvezetőjének a szociális konzultáció kérdőíveinek kezelésével kapcsolatos feljelentését, Schiffer András azonban panaszt tesz a határozat ellen, és kéri a felülvizsgálatát.	','hirek/magyar-hirek/visszadobta-a-brfk-az-lmp-feljelenteset','2011-11-17 21:20:48','2011-11-17 21:20:48',2,'http://www.k-monitor.hu/hirek/magyar-hirek/visszadobta-a-brfk-az-lmp-feljelenteset',NULL,NULL,'normal',NULL),(304,'Törvénytelenségek a vagyonőröknél','\r\n		Az adóhatóság az idei vizsgálatai során minden második őrző-védő cégnél talált szabálytalanságokat. Nem fizetnek adót és közterheket alkalmazottaik után, alvállalkozói láncolatok útvesztőin, s fiktív számlákkal igyekeznek kibújni az adófizetési kötelezettség alól.	','hirek/magyar-hirek/torvenytelensegek-a-vagyonoroknel','2011-11-17 21:20:48','2011-11-17 21:20:48',2,'http://www.k-monitor.hu/hirek/magyar-hirek/torvenytelensegek-a-vagyonoroknel',NULL,NULL,'normal',NULL),(305,'Hunvald-per: nyáron már nem folytatják','\r\n		Vádlottak meghallgatásával folytatódott a Hunvald-ügy tárgyalása pénteken a Fővárosi Bíróságon (FB). A bíróság erre a napra tizenegy vádlott meghallgatását tervezte, ám három vallomást már csak ősszel hallgatnak meg.	','hirek/magyar-hirek/hunvald-per-nyaron-mar-nem-folytatjak','2011-11-17 21:20:52','2011-11-17 21:20:52',2,'http://www.k-monitor.hu/hirek/magyar-hirek/hunvald-per-nyaron-mar-nem-folytatjak',NULL,NULL,'normal',NULL),(306,'Mi lesz Budapest magányos bálnájával?','\r\n		Nemrég még úgy tűnt, lesz előrelépés a Duna-parton árválkodó CET ügyében, ám a napokban a főváros után az ÁSZ is feljelentést tett a beruházás miatt. A CET fejlesztője szerint a feljelentések mögött az előző és a jelenlegi városvezetés csatározása áll.	','hirek/magyar-hirek/mi-lesz-budapest-maganyos-balnajaval','2011-11-17 21:20:53','2011-11-17 21:20:53',2,'http://www.k-monitor.hu/hirek/magyar-hirek/mi-lesz-budapest-maganyos-balnajaval',NULL,NULL,'normal',NULL),(307,'Bodoky Tamás: Az elszámoltatás vakfoltjai III. - A panamai szabók','\r\n		Amerikai becslés szerint globálisan 7400 milliárd dollárra rúg az off­shore-központokban elhelyezett vagyon értéke, ami annak ellenére tovább növekszik, hogy a gazdasági válság miatt a nemzetállamok évek óta korlátozni próbálják az offshore cégek mozgásterét a világgazdaságban.	','hirek/magyar-hirek/bodoky-tamas-az-elszamoltatas-vakfoltjai-iii-a-panamai-szabok','2011-11-17 21:20:54','2011-11-17 21:20:54',2,'http://www.k-monitor.hu/hirek/magyar-hirek/bodoky-tamas-az-elszamoltatas-vakfoltjai-iii-a-panamai-szabok',NULL,NULL,'normal',NULL),(308,'Balogh Hrvoje: A MOL-INA-ügy: Vesztegetés vagy újabb horvátországi lejárató kampány?','\r\n		Újabb vádpontok merültek fel az Ausztriában jelenleg kiadatását váró Ivo Sanader büntetőeljárásában. A volt horvát kormányfőt súlyos korrupciós vádak miatt még a télen, Ausztriában tartóztatták le az Interpol elfogatóparancsa alapján.	','hirek/magyar-hirek/balogh-hrvoje-a-mol-ina-ugy-vesztegetes-vagy-ujabb-horvatorszagi-lejarato-kampany','2011-11-17 21:22:07','2011-11-17 21:22:07',2,'http://www.k-monitor.hu/hirek/magyar-hirek/balogh-hrvoje-a-mol-ina-ugy-vesztegetes-vagy-ujabb-horvatorszagi-lejarato-kampany',NULL,NULL,'normal',NULL),(309,'A Jobbik nekiment Pintér Sándornak','\r\n		A Jobbik szerint Pintér Sándor belügyminiszter korábbi vállalkozása a közbeszerzési szabályokkal ellentétesen, a legdrágább ajánlatot adva nyerte el a budapesi fürdők őrzését, és hasonlóképpen kötött megállapodást a Magyar Nemzeti Vagyonkezelő (MNV) Zrt.-vel is.	','hirek/magyar-hirek/a-jobbik-nekiment-pinter-sandornak','2011-11-17 21:22:10','2011-11-17 21:22:10',2,'http://www.k-monitor.hu/hirek/magyar-hirek/a-jobbik-nekiment-pinter-sandornak',NULL,NULL,'normal',NULL),(310,'Feljelentette a Jobbik a Gyógyfürdő Zrt-t','\r\n		Feljelentést tett Staudt Gábor, a Jobbik budapesti elnöke a Budapest Gyógyfürdői és Hévizei Zrt. (BGYH Zrt.) egyik korábbi szerződése miatt a Budapesti Rendőr-főkapitányságon. A párt szerint a fővárosi strandokat és fürdőket üzemeltető társaság 2009 júniusában olyan szerződést kötött az Opero Kft.-vel, amely felveti a bűncselekmények elkövetésének gyanúját. Az Origo ugyanakkor a fürdők őrzésére kiírt pályázat visszásságairól számolt be.	','hirek/magyar-hirek/feljelentette-a-jobbik-a-gyogyfurdo-zrt-t','2011-11-17 21:22:23','2011-11-17 21:22:23',2,'http://www.k-monitor.hu/hirek/magyar-hirek/feljelentette-a-jobbik-a-gyogyfurdo-zrt-t',NULL,NULL,'normal',NULL),(311,'A CET beruházója áll a vizsgálat elé','\r\n		Az Állami Számvevőszék feljelentésével kapcsolatban a Duna-parti CET beruházója, a Porto Investment készséggel áll bármilyen vizsgálat elé, áll a cég közleményében. Az üresen álló kulturpláza ügyében a főváros és a számvevőszék hűtlen kezelés gyanújával feljelentést tett.	','hirek/magyar-hirek/a-cet-beruhazoja-all-a-vizsgalat-ele','2011-11-17 21:22:27','2011-11-17 21:22:27',2,'http://www.k-monitor.hu/hirek/magyar-hirek/a-cet-beruhazoja-all-a-vizsgalat-ele',NULL,NULL,'normal',NULL),(312,'Ami már nem titkos, arról sem tudni semmit','\r\n		Titkos volt az olajügyekben nyomozó rendőr elleni eljárás, titkosak a Gripen-akták, az OTP-s túszejtés részletei, egy korábbi pedofil képviselő ügye, Csernobil, és titkosak a titkosszolgálati mágnesszalagok.	','hirek/magyar-hirek/ami-mar-nem-titkos-arrol-sem-tudni-semmit','2011-11-17 21:22:28','2011-11-17 21:22:28',2,'http://www.k-monitor.hu/hirek/magyar-hirek/ami-mar-nem-titkos-arrol-sem-tudni-semmit',NULL,NULL,'normal',NULL),(313,'Blikk: Megfellebbezné az ügyészség Galambos Lajos házi őrizetét','\r\n		Fellebbezés várható pénteken Galambos Lajos volt NBH-vezető ügyében - írja a Blikk. A lap szerint az ügyészség meg akarja támadni azt a bírósági döntést, amely előzetes letartóztatás helyett csupán házi őrizetet írt elő a kémkedéssel gyanúsított férfinak, Szilvásy György volt titokminisztert és Laborc Sándor korábbi NBH-vezérigazgatót pedig szabadlábra helyezte.	','hirek/magyar-hirek/blikk-megfellebbezne-az-ugyeszseg-galambos-lajos-hazi-orizetet','2011-11-17 21:22:33','2011-11-17 21:22:33',2,'http://www.k-monitor.hu/hirek/magyar-hirek/blikk-megfellebbezne-az-ugyeszseg-galambos-lajos-hazi-orizetet',NULL,NULL,'normal',NULL),(314,'A kémbotrány bírája már lelepleződött','\r\n		Évekkel ezelőtt kivételezett eljárásban részesített több vezető MSZP-s politikust, így Kiss Péter volt kancelláriaminisztert és Tóth András egykori nemzetbiztonsági államtitkárt az a bíró, aki a napokban a kémbotrányban érintett volt titkosszolgálati vezetőkkel szemben enyhe kényszerintézkedésekről döntött.	','hirek/magyar-hirek/a-kembotrany-biraja-mar-leleplezodott','2011-11-17 21:22:36','2011-11-17 21:22:36',2,'http://www.k-monitor.hu/hirek/magyar-hirek/a-kembotrany-biraja-mar-leleplezodott',NULL,NULL,'normal',NULL),(315,'Régi nemzetbiztonsági belharc kíséri a Szilvásy-ügyet','\r\n		A Gyurcsány-kormány és az akkor ellenzékben lévő fideszesek közötti politikai küzdelem része volt az az úgynevezett hackertámadási ügy, amellyel összefüggésben az egyik lehetséges magyarázat szerint meggyanúsították Szilvásy György egykori titokminisztert és két korábbi nemzetbiztonsági főnököt. Szilvásy 2008-ban még a szerinte a Fideszhez kötődő UD Zrt. nevű céget gyanúsította azzal, hogy titkos adatgyűjtést végzett, 2010 végén a Fidesz már azt állította, hogy az esetleges adatgyűjtésért egy, az akkori titokminiszterhez köthető hacker lehet a felelős.	','hirek/magyar-hirek/regi-nemzetbiztonsagi-belharc-kiseri-a-szilvasy-ugyet','2011-11-17 21:22:39','2011-11-17 21:22:39',2,'http://www.k-monitor.hu/hirek/magyar-hirek/regi-nemzetbiztonsagi-belharc-kiseri-a-szilvasy-ugyet',NULL,NULL,'normal',NULL),(316,'Nyomáspróba','\r\n		Saját jelöltjének teremt helyet a kormány a százmilliárdos üzlettel kecsegtető nemzetközi gázvezeték-beruházásokra.	','hirek/magyar-hirek/nyomasproba','2011-11-17 21:22:46','2011-11-17 21:22:46',2,'http://www.k-monitor.hu/hirek/magyar-hirek/nyomasproba',NULL,NULL,'normal',NULL),(317,'\"A dohánylobbi erősebb volt\"','\r\n		Biztosították, hogy továbbra is a magyar dohányosok jussanak az EU-ban szinte a legolcsóbban cigarettához, a dohánygyáraknak pedig azt, hogy az elmúlt félév drasztikus árcsökkentése után ne kelljen még lejjebb adniuk nyereségüket...	','hirek/magyar-hirek/a-dohanylobbi-erosebb-volt','2011-11-17 21:23:12','2011-11-17 21:23:12',2,'http://www.k-monitor.hu/hirek/magyar-hirek/a-dohanylobbi-erosebb-volt',NULL,NULL,'normal',NULL),(318,'Az Orbán-kormány bőkezűsége Nézőpont kérdése','\r\n		A Fidesz-közeli Nézőpont Intézet médiafigyelő cége az Orbán-kormány legnagyobb sajtószemle-beszállítója. A Médianéző Kft. sorra kapja a kormányzati megrendeléseket, a cég éves állami megrendelése számításaink szerint meghaladja a tizenötmillió forintot.	','hirek/magyar-hirek/az-orban-kormany-bokezusege-nezopont-kerdese','2011-11-17 21:23:13','2011-11-17 21:23:13',2,'http://www.k-monitor.hu/hirek/magyar-hirek/az-orban-kormany-bokezusege-nezopont-kerdese',NULL,NULL,'normal',NULL),(319,'Gyanúsan alacsony áron adták el a bábolnai üzemeket','\r\n		Újabb nyomozás indult a Bábolna Zrt. felszámolásával kapcsolatban – értesült lapunk. Az ügyészség ezúttal egy 16 hektáros terület gyanúsan alacsony áron történt értékesítése miatt, csődbűntett gyanújával kezdett vizsgálatot Budai Gyula elszámoltatási és korrupcióellenes kormánybiztos feljelentése nyomán.	','hirek/magyar-hirek/gyanusan-alacsony-aron-adtak-el-a-babolnai-uzemeket','2011-11-17 21:23:18','2011-11-17 21:23:18',2,'http://www.k-monitor.hu/hirek/magyar-hirek/gyanusan-alacsony-aron-adtak-el-a-babolnai-uzemeket',NULL,NULL,'normal',NULL),(320,'Több milliárdot kereshet újabb állami megbízásaival Pintér Sándor excége','\r\n		Újabb, összességében többmilliárdos állami megbízásokat nyert el más cégekkel közösen pályázva a Civil Biztonsági Szolgálat nevű biztonsági cég, amely a tavalyi választások előtt Pintér Sándor belügyminiszter tulajdonában állt - derül ki a legfrissebb közbeszerzési dokumentumokból és az [origo] kérdéseire adott hivatalos válaszokból. A Budapest Gyógyfürdői és Hévizei Zrt.-vel kötött szerződés 553 millió forintról szól, a Magyar Nemzeti Vagyonkezelővel aláírt, 2014 végéig szóló megállapodás pedig akár 4,3 milliárdos bevételt is jelenthet a CBSZ-nek és társainak.	','hirek/magyar-hirek/tobb-milliardot-kereshet-ujabb-allami-megbizasaival-pinter-sandor-excege','2011-11-17 21:23:20','2011-11-17 21:23:20',2,'http://www.k-monitor.hu/hirek/magyar-hirek/tobb-milliardot-kereshet-ujabb-allami-megbizasaival-pinter-sandor-excege',NULL,NULL,'normal',NULL),(321,'Büntetlenül kartelezhetett a Szijjártó-cég','\r\n		Nem tett feljelentést a Gazdasági Versenyhivatal (GVH) a Vasútépítők Kft. segítsége által feltárt kartellezési ügyben – közölték a hvg.hu-val. A versenyhivatal szerint azért nem tettek feljelentést, mert a jogsértés még a büntető törvénykönyvben bevezetett változás előtt történt.	','hirek/magyar-hirek/buntetlenul-kartelezhetett-a-szijjarto-ceg','2011-11-17 21:23:45','2011-11-17 21:23:45',2,'http://www.k-monitor.hu/hirek/magyar-hirek/buntetlenul-kartelezhetett-a-szijjarto-ceg',NULL,NULL,'normal',NULL),(322,'Szilvásy szivárogtatását vitatták a tárgyaláson','\r\n		Adatvédelmi biztos és informatikai szakértő meghallgatásával folytatódott Szilvásy Györgynek és az UD Zrt.-ügy többi vádlottjának tárgyalása. A nyári szünet után szeptemberben Csányi Sándor forrósíthatja fel a hangulatot a tárgyalóteremben.	','hirek/magyar-hirek/szilvasy-szivarogtatasat-vitattak-a-targyalason','2011-11-17 21:23:55','2011-11-17 21:23:55',2,'http://www.k-monitor.hu/hirek/magyar-hirek/szilvasy-szivarogtatasat-vitattak-a-targyalason',NULL,NULL,'normal',NULL),(323,'Egy szlovák nő és ázsiai üzletek - milyen közös titkaik vannak Szilvásyéknak?','\r\n		Két elvarratlan külföldi szál is maradt abban a csalási ügyben, amelyhez valamilyen köze volt a múlt héten kémkedéssel meggyanúsított titkosszolgálati vezetőknek és Szilvásy György korábbi titokminiszternek is. A titkosszolgálatokkal együttműködő Egymásért Alapítvány Pozsonyban működtetett egy tisztázatlan feladatú irodát, és állítólag rendőri vezetőkig érő ázsiai vámcsalásokról is tudomásuk volt.	','hirek/magyar-hirek/egy-szlovak-no-es-azsiai-uzletek-milyen-kozos-titkaik-vannak-szilvasyeknak','2011-11-17 21:24:09','2011-11-17 21:24:09',2,'http://www.k-monitor.hu/hirek/magyar-hirek/egy-szlovak-no-es-azsiai-uzletek-milyen-kozos-titkaik-vannak-szilvasyeknak',NULL,NULL,'normal',NULL),(324,'Megint tanú','\r\n		Titkosítással igyekszik leplezni az ügyészség, hogy nagyon úgy fest, ismét mellényúlt a politika elszámoltatási igyekezetének kiszolgálásakor. Meglehet, a gyanúsítottak nemzetközi kémjátszma statisztái – éppúgy, mint a vádlók.	','hirek/magyar-hirek/megint-tanu','2011-11-17 21:24:30','2011-11-17 21:24:30',2,'http://www.k-monitor.hu/hirek/magyar-hirek/megint-tanu',NULL,NULL,'normal',NULL),(325,'Fellegi súlyos vádjai: Egy ppp szerződéssel sem jártunk jól','\r\n		Egy olyan szerződést sem találtak, amellyel jól járt az állam – állította Fellegi Tamás parlamenti meghallgatásán.	','hirek/magyar-hirek/fellegi-sulyos-vadjai-egy-ppp-szerzodessel-sem-jartunk-jol','2011-11-17 21:24:47','2011-11-17 21:24:47',2,'http://www.k-monitor.hu/hirek/magyar-hirek/fellegi-sulyos-vadjai-egy-ppp-szerzodessel-sem-jartunk-jol',NULL,NULL,'normal',NULL),(326,'Megvolt a győztes, mégis csúszik a Zeneakadémia felújítása','\r\n		Megsemmisítette a Zeneakadémia rekonstrukciójára kiírt megismételt közbeszerzési eljárás eredményét a Közbeszerzési Döntőbizottság, mert az egyetem az eljárás során több ponton megsértette a törvényt.	','hirek/magyar-hirek/megvolt-a-gyoztes-megis-csuszik-a-zeneakademia-felujitasa','2011-11-17 21:24:48','2011-11-17 21:24:48',2,'http://www.k-monitor.hu/hirek/magyar-hirek/megvolt-a-gyoztes-megis-csuszik-a-zeneakademia-felujitasa',NULL,NULL,'normal',NULL),(327,'A horvát versenyhatóságnál is támadják a Molt','\r\n		Hernádi Zsolt Mol-elnök-vezérigazgató hivatalosan cáfolt horvát kiadatási kérelmének keddi híre mellett folytatódik a Mol elleni horvátországi támadássorozat: zágrábi sajtóbeszámolók szerint az INA felügyelőbizottságának horvát kormány által delegált tagjai már a versenyhatóságon keresztül is próbálják érvényteleníteni a Mol INA felett gyakorolt irányítási jogát. Egy másik lap szerint a Mol már keresi a kapcsolatot a közeledő választások várható győztesével.	','hirek/magyar-hirek/a-horvat-versenyhatosagnal-is-tamadjak-a-molt','2011-11-17 21:24:51','2011-11-17 21:24:51',2,'http://www.k-monitor.hu/hirek/magyar-hirek/a-horvat-versenyhatosagnal-is-tamadjak-a-molt',NULL,NULL,'normal',NULL),(328,'Dávid Ibolya tagadta bűnösségét','\r\n		Az MDF volt elnöke szerint az UD Zrt. ügy vádirata koncepciós.	','hirek/magyar-hirek/david-ibolya-tagadta-bunosseget','2011-11-17 21:24:53','2011-11-17 21:24:53',2,'http://www.k-monitor.hu/hirek/magyar-hirek/david-ibolya-tagadta-bunosseget',NULL,NULL,'normal',NULL),(329,'Vesztegetési vádak vezettek Hernádi cáfolt kiadatási kérelmének híréhez','\r\n		Az állítólagos kenőpénzek miatt Horvátország akár fel is mondhatja a Molnak a korábbi kormánnyal kötött szerződését. A Mol elleni támadások erősödhetnek őszig, amikor választásokat tarthatnak Horvátországban. A Mol vezérigazgatója körül kirobbant korrupciós vádak mögött az Ivo Sanaderrel szoros kapcsolatban álló befolyásos horvát üzletember vallomása állhat.	','hirek/magyar-hirek/vesztegetesi-vadak-vezettek-hernadi-cafolt-kiadatasi-kerelmenek-hirehez','2011-11-17 21:24:57','2011-11-17 21:24:57',2,'http://www.k-monitor.hu/hirek/magyar-hirek/vesztegetesi-vadak-vezettek-hernadi-cafolt-kiadatasi-kerelmenek-hirehez',NULL,NULL,'normal',NULL),(330,'Hernádi-ügy: Orbán ismeri a vádakat, Fellegi nem','\r\n		A vádakat ismerjük, nem tekintjük kormányközi kérdésnek - ez a miniszterelnök kommentje Hernádi Zsolt ügyében.	','hirek/magyar-hirek/hernadi-ugy-orban-ismeri-a-vadakat-fellegi-nem','2011-11-17 21:25:02','2011-11-17 21:25:02',2,'http://www.k-monitor.hu/hirek/magyar-hirek/hernadi-ugy-orban-ismeri-a-vadakat-fellegi-nem',NULL,NULL,'normal',NULL),(331,'Fellegi: Nem kötöttünk háttéralkut a Szurgut Mol-részvényeinek megvásárlásakor','\r\n		Az uniós kohéziós politika jövőjéről, a Széchenyi-terv elindításának sikeréről beszélt kedden Fellegi Tamás fejlesztési miniszter, aki azt ígérte, hogy őszre elkészül az állami vagyonleltár. A miniszter szót ejtett a Mol-ügyletről is, amelyben elmondása szerint nem született háttéralku, a Malév ügyét pedig a legnehezebb megoldandó erkölcsi, pénzügyi kérdésnek nevezte.	','hirek/magyar-hirek/fellegi-nem-kotottunk-hatteralkut-a-szurgut-mol-reszvenyeinek-megvasarlasakor','2011-11-17 21:25:03','2011-11-17 21:25:03',2,'http://www.k-monitor.hu/hirek/magyar-hirek/fellegi-nem-kotottunk-hatteralkut-a-szurgut-mol-reszvenyeinek-megvasarlasakor',NULL,NULL,'normal',NULL),(332,'Feljelentéseket tesz az MFB','\r\n		A Magyar Fejlesztési Bank (MFB) Zrt. a bank, illetve a vagyonkezelt intézmények átvilágítása után számos esetben polgári jogi, illetve büntetőjogi eljárást kezdeményezett, mert különféle bűncselekmények gyanúja merült fel, amelyeknek skálája a csalástól és a sikkasztástól a hűtlen kezelésig terjed - jelentette be a bank elnök-vezérigazgatója kedden.	','hirek/magyar-hirek/feljelenteseket-tesz-az-mfb','2011-11-17 21:25:05','2011-11-17 21:25:05',2,'http://www.k-monitor.hu/hirek/magyar-hirek/feljelenteseket-tesz-az-mfb',NULL,NULL,'normal',NULL),(333,'Őrizet után bíróság előtt Szilvásy','\r\n		Szilvásy György, Gyurcsány Ferenc egykori titokminisztere elsőrendű vádlottként jelent meg ma a bíróság előtt hétvégi őrizetbe vételét követően. Lehallgatások, orosz kapcsolatok, kémkedés.	','hirek/magyar-hirek/orizet-utan-birosag-elott-szilvasy','2011-11-17 21:25:09','2011-11-17 21:25:09',2,'http://www.k-monitor.hu/hirek/magyar-hirek/orizet-utan-birosag-elott-szilvasy',NULL,NULL,'normal',NULL),(334,'Nem kapott hivatalos értesítést a Mol a horvátországi kiadatásról','\r\n		Sem a Mol, sem Hernádi Zsolt, az olajipari társaság elnök-vezérigazgatója nem kapott hivatalos értesítést arról, hogy Horvátország jogsegély keretében hivatalosan is kérte Hernádi Zsolt előzetes kiadatását - mondta Pánczél Andrea, a Mol kommunikációs vezetője.	','hirek/magyar-hirek/nem-kapott-hivatalos-ertesitest-a-mol-a-horvatorszagi-kiadatasrol','2011-11-17 21:25:18','2011-11-17 21:25:18',2,'http://www.k-monitor.hu/hirek/magyar-hirek/nem-kapott-hivatalos-ertesitest-a-mol-a-horvatorszagi-kiadatasrol',NULL,NULL,'normal',NULL),(335,'Szilvásyt is kémkedéssel gyanúsítják','\r\n		Szabadon távozott tegnap Szilvásy György a Fővárosi Bíróság Katonai Tanácsa tárgyalóterméből, ahova kora délután még bilincsbe verve, vezetőszáron érkezett a Gyorskocsi utcai börtön épületéből, ahol péntek éjjel óta volt őrizetben.	','hirek/magyar-hirek/szilvasyt-is-kemkedessel-gyanusitjak','2011-11-17 21:25:19','2011-11-17 21:25:19',2,'http://www.k-monitor.hu/hirek/magyar-hirek/szilvasyt-is-kemkedessel-gyanusitjak',NULL,NULL,'normal',NULL),(336,'Szilvásy már megjelent, még várják Dávidot és Herényit + Videó + Képriport','\r\n		Elkezdődött kedd reggel a tárgyalás az UD Zrt.-ügyben, amelyben Szilvásy György volt titokminisztert, Tóth Károly volt szocialista nemzetbiztonsági bizottsági alelnököt, illetve Dávid Ibolyát és Herényi Károlyt azzal vádolják, hogy az érintettek engedélye nélkül hozták nyilvánosságra a titkosszolgálat által lehallgatott telefonbeszélgetések másolatát.	','hirek/magyar-hirek/szilvasy-mar-megjelent-meg-varjak-davidot-es-herenyit-video-kepriport','2011-11-17 21:25:21','2011-11-17 21:25:21',2,'http://www.k-monitor.hu/hirek/magyar-hirek/szilvasy-mar-megjelent-meg-varjak-davidot-es-herenyit-video-kepriport',NULL,NULL,'normal',NULL),(337,'Csepeli ügy: Deme Gábor pszichopata?','\r\n		Pszichopatának nevezte tegnap a csepeli kettős gyilkosságban bűnsegédlettel vádolt Deme Gábor egykori szocialista politikust az iskola gyermekpszichológusa.	','hirek/magyar-hirek/csepeli-ugy-deme-gabor-pszichopata','2011-11-17 21:25:24','2011-11-17 21:25:24',2,'http://www.k-monitor.hu/hirek/magyar-hirek/csepeli-ugy-deme-gabor-pszichopata',NULL,NULL,'normal',NULL),(338,'Nem tudni, ki lehet a kémkedés negyedik, titokzatos gyanúsítottja','\r\n		Egyes információk szerint a kémkedés miatt indult büntetőeljárás negyedik gyanúsítottjának, a bíróság előtt hétfőn megjelent, eltakart arcú titokzatos férfinak elrendelte a bíróság az előzetes letartóztatását.	','hirek/magyar-hirek/nem-tudni-ki-lehet-a-kemkedes-negyedik-titokzatos-gyanusitottja','2011-11-17 21:25:24','2011-11-17 21:25:24',2,'http://www.k-monitor.hu/hirek/magyar-hirek/nem-tudni-ki-lehet-a-kemkedes-negyedik-titokzatos-gyanusitottja',NULL,NULL,'normal',NULL),(339,'Nem kérték ki a horvátok Hernádit','\r\n		Sem a Mol, sem Hernádi Zsolt nem kapott hivatalos értesítést arról, hogy Horvátország jogsegély keretében hivatalosan is kérte Hernádi Zsolt előzetes kiadatását.	','hirek/magyar-hirek/kikertek-a-horvatok-hernadit-zuhan-a-mol','2011-11-17 21:25:25','2011-11-17 21:25:25',2,'http://www.k-monitor.hu/hirek/magyar-hirek/kikertek-a-horvatok-hernadit-zuhan-a-mol',NULL,NULL,'normal',NULL),(340,'Lezárult a vizsgálat, nem sikkasztottak a Debreceni Egyetemen','\r\n		Budai Gyula szerint megfelelően használta fel az állami költségvetésből rendelkezésére bocsátott támogatást a Debreceni Egyetem agrárcentruma.	','hirek/magyar-hirek/lezarult-a-vizsgalat-nem-sikkasztottak-a-debreceni-egyetemen','2011-11-17 21:25:29','2011-11-17 21:25:29',2,'http://www.k-monitor.hu/hirek/magyar-hirek/lezarult-a-vizsgalat-nem-sikkasztottak-a-debreceni-egyetemen',NULL,NULL,'normal',NULL),(341,'Kidobnák a kukába a ppp-szerződéseket','\r\n		A kormány a következő hetekben dönt a jelenlegi ppp-szerződései kiváltásának mikéntjéről, amit a Széll Kálmán Tervben erre szánt 200 milliárd forintból kívánnak megvalósítani. Az átvizsgált szerződések mindegyikének kockázatát az állam viselte. Ha nem váltanák ki a szerződéseket, az 3.000 milliárd forintos terhet jelentene a költségvetésnek.	','hirek/magyar-hirek/kidobnak-a-kukaba-a-ppp-szerzodeseket','2011-11-17 21:25:30','2011-11-17 21:25:30',2,'http://www.k-monitor.hu/hirek/magyar-hirek/kidobnak-a-kukaba-a-ppp-szerzodeseket',NULL,NULL,'normal',NULL),(342,'Bilincsben jött, szabadon távozott','\r\n		A dolgok mai állása szerint, miután nyolcvan évre titkosították, unokáink sem fogják megtudni, miért vezették bilincsben 2011. július 4-én a kémkedéssel gyanúsított Szilvásy Györgyöt a Fővárosi Bíróság Katonai Tanácsa elé.	','hirek/magyar-hirek/bilincsben-jott-szabadon-tavozott','2011-11-17 21:25:30','2011-11-17 21:25:30',2,'http://www.k-monitor.hu/hirek/magyar-hirek/bilincsben-jott-szabadon-tavozott',NULL,NULL,'normal',NULL),(343,'Gyurcsány megfenyegette Polt Pétert','\r\n		\"Az ügyészség egy része, a politikai kinevezett főügyésszel az élen meg a hatalom hűséges ölebeként végzi a mocskos munkát. Azt hiszik, örökre sértetlenek maradhatnak. Tévednek\" - ezt írja Gyurcsány.	','hirek/magyar-hirek/gyurcsany-megfenyegette-polt-petert','2011-11-17 21:25:33','2011-11-17 21:25:33',2,'http://www.k-monitor.hu/hirek/magyar-hirek/gyurcsany-megfenyegette-polt-petert',NULL,NULL,'normal',NULL),(344,'Laborc ügyvédje vakvágánynak nevezte a találgatásokat a meggyanúsított titkosszolgák ügyében','\r\n		A volt titkosszolgálati vezetők és a volt titokminiszter ügyében a sajtóban megjelent találgatásokat vakvágánynak nevezte hétfőn Laborc Sándor ügyvédje a Tv2 Mokka című műsorában. Zamecsnik Péter szerint nem politikai ügyről van szó, az ügyvéd elmondta azt is, hogy egyetért az ügy részleteinek titkos kezelésével.	','hirek/magyar-hirek/laborc-ugyvedje-vakvaganynak-nevezte-a-talalgatasokat-a-meggyanusitott-titkosszolgak-ugyeben','2011-11-17 21:25:37','2011-11-17 21:25:37',2,'http://www.k-monitor.hu/hirek/magyar-hirek/laborc-ugyvedje-vakvaganynak-nevezte-a-talalgatasokat-a-meggyanusitott-titkosszolgak-ugyeben',NULL,NULL,'normal',NULL),(345,'Szilvásyval új lendületet vett az elszámoltatás','\r\n		Szilvásy György lett az első volt szocialista miniszter, akit őrizetbe vettek, mióta az elszámoltatással kampányoló Fidesz hatalomra került.	','hirek/magyar-hirek/szilvasyval-uj-lenduletet-vett-az-elszamoltatas','2011-11-17 21:25:38','2011-11-17 21:25:38',2,'http://www.k-monitor.hu/hirek/magyar-hirek/szilvasyval-uj-lenduletet-vett-az-elszamoltatas',NULL,NULL,'normal',NULL),(346,'Szilvásy nem aludt egyedül a fogdán, őrizetben Laborc is','\r\n		Szombaton őrizetbe vették és bűnpártolással gyanúsították meg Laborc Sándort, a Nemzetbiztonsági Hivatal volt főigazgatóját, a korábban kémkedéssel meggyanúsított Galambos Lajos utódját is	','hirek/magyar-hirek/szilvasy-nem-aludt-egyedul-a-fogdan-orizetben-laborc-is','2011-11-17 21:25:57','2011-11-17 21:25:57',2,'http://www.k-monitor.hu/hirek/magyar-hirek/szilvasy-nem-aludt-egyedul-a-fogdan-orizetben-laborc-is',NULL,NULL,'normal',NULL),(347,'Kikérték a Mol-vezért, a Fidesz elengedheti Hernádi kezét','\r\n		Horvátország jogsegély keretében hivatalosan is kérte Hernádi Zsolt, a Mol Nyrt. elnök-vezérigazgatója előzetes kiadatását.	','hirek/magyar-hirek/kikertek-a-mol-vezert-a-fidesz-elengedheti-hernadi-kezet','2011-11-17 21:25:58','2011-11-17 21:25:58',2,'http://www.k-monitor.hu/hirek/magyar-hirek/kikertek-a-mol-vezert-a-fidesz-elengedheti-hernadi-kezet',NULL,NULL,'normal',NULL),(348,'Az LMP legyőzte az offshore-javaslatot','\r\n		Az LMP fellépésének köszönhetően a Fidesz visszavonja az offshore cégekben található jövedelem adómentességét célzó jogszabályt, ami ellentétes volt az ország érdekeivel.	','hirek/magyar-hirek/az-lmp-legyozte-az-offshore-javaslatot','2011-11-17 21:25:59','2011-11-17 21:25:59',2,'http://www.k-monitor.hu/hirek/magyar-hirek/az-lmp-legyozte-az-offshore-javaslatot',NULL,NULL,'normal',NULL),(349,'Szilvásy szabadlábon védekezhet','\r\n		Maratoni tárgyalás után döntött a bíróság arról, hogy nem helyezi előzetes letartóztatásba Szilvásy György egykori titokminisztert. Az MTI korábbi tudósítása szerint Szilvásyt bilincsben vezették ki a tárgyalóteremből, ám később kiderült, hogy akkor csak szünetet tartott a bíróság.	','hirek/magyar-hirek/szilvasy-szabadlabon-vedekezhet','2011-11-17 21:26:00','2011-11-17 21:26:00',2,'http://www.k-monitor.hu/hirek/magyar-hirek/szilvasy-szabadlabon-vedekezhet',NULL,NULL,'normal',NULL),(350,'Átláthatóság: a soros EU elnökség számokban','\r\n		Az Európai Unió Tanácsának soros elnöki tisztségét Magyarország töltötte be 2011. január 1. és június 30. között. A K-Monitor az elmúlt fél évben arra törekedett, hogy olvasói számára átláthatóvá tegye, mire mennyit és mi célból költ az állam egy olyan kiemelkedően fontos esemény kapcsán, amely legközelebb 14 év múlva lesz esedékes.	','hirek/magyar-hirek/atlathatosag-a-soros-eu-elnokseg-szamokban','2011-11-17 21:26:00','2011-11-17 21:26:00',2,'http://www.k-monitor.hu/hirek/magyar-hirek/atlathatosag-a-soros-eu-elnokseg-szamokban',NULL,NULL,'normal',NULL),(351,'A Mol és a titokszolgák','\r\n		Szilvásy György, Galambos Lajos és Laborc Sándor, vagyis a Gyurcsány-kormány teljes titkosszolgálati vezetése, egy exminiszter és két egykori nemzetbiztonsági vezető került a múlt héten előzetes letartóztatásba. Lehet-e mindennek köze a Molhoz?	','hirek/magyar-hirek/a-mol-es-a-titokszolgak','2011-11-17 21:26:01','2011-11-17 21:26:01',2,'http://www.k-monitor.hu/hirek/magyar-hirek/a-mol-es-a-titokszolgak',NULL,NULL,'normal',NULL),(352,'Kémsztori: mind Gyurcsány embere volt','\r\n		Galambos Lajos és Szilvásy György után őrizetbe vették Laborc Sándort is, akit bűnpártolással gyanúsítanak. A volt NBH-s vezető Szilvásy György minisztersége ideje alatt irányította a Nemzetbiztonsági Hivatalt (NBH).	','hirek/magyar-hirek/kemsztori-mind-gyurcsany-embere-volt','2011-11-17 21:26:04','2011-11-17 21:26:04',2,'http://www.k-monitor.hu/hirek/magyar-hirek/kemsztori-mind-gyurcsany-embere-volt',NULL,NULL,'normal',NULL),(353,'A nemzetbiztonsági bizottság rendkívüli ülést tart ma','\r\n		Vadai Ágnes, az Országgyűlés nemzetbiztonsági bizottságának szocialista elnöke vasárnap sajtótájékoztatón jelentette be, hogy mára összehívta a testület rendkívüli ülését.	','hirek/magyar-hirek/a-nemzetbiztonsagi-bizottsag-rendkivuli-ulest-tart-ma','2011-11-17 21:26:09','2011-11-17 21:26:09',2,'http://www.k-monitor.hu/hirek/magyar-hirek/a-nemzetbiztonsagi-bizottsag-rendkivuli-ulest-tart-ma',NULL,NULL,'normal',NULL),(354,'Hogy állhat össze a kép Galambos, Laborc és Szilvásy ügyében?','\r\n		Jakubinyi Róbertet, az Egymásért Alapítvány csempészetért elítélt vezetőjének, Földesi-Szabó Lászlónak az üzlettársát alig három hete fogták el. Azóta két egykori NBH-főigazgatóval és egy volt titokminiszterrel szemben indult büntetőeljárás államellenes bűntettek gyanúja miatt.	','hirek/magyar-hirek/hogy-allhat-ossze-a-kep-galambos-laborc-es-szilvasy-ugyeben','2011-11-17 21:26:09','2011-11-17 21:26:09',2,'http://www.k-monitor.hu/hirek/magyar-hirek/hogy-allhat-ossze-a-kep-galambos-laborc-es-szilvasy-ugyeben',NULL,NULL,'normal',NULL),(355,'Egy fedőcég kalandos élete','\r\n		Az Egymásért Egy-Másért Alapítvány 1,2 milliárdos csempészési ügye bombaként robbant 2007-ben. Addig ugyanis az alapítvány kuratóriumi elnöke, Földesi-Szabó László gyermekmentési akciójától vagy éppen Bálint Antóniával való kapcsolatáról volt hangos a sajtó.	','hirek/magyar-hirek/egy-fedoceg-kalandos-elete','2011-11-17 21:26:20','2011-11-17 21:26:20',2,'http://www.k-monitor.hu/hirek/magyar-hirek/egy-fedoceg-kalandos-elete',NULL,NULL,'normal',NULL),(356,'2089-ig titkosították a Szilvásyékról szóló bizottsági ülés jegyzőkönyvét','\r\n		A parlament nemzetbiztonsági bizottságának MSZP-s elnöke szerint nevetséges dolgokkal gyanúsítják Szivásy György korábbi titokminisztert és a polgári titkosszolgálatok két korábbi vezetőjét, akiket az ügyészség által eddig meg nem erősített hírek szerint múlt héten gyanúsítottak meg és vettek őrizetbe.	','hirek/magyar-hirek/a-fideszesekkel-egyutt-zart-ulesen-targyalnak-szilvasyekrol-a-parlamentben','2011-11-17 21:26:22','2011-11-17 21:26:22',2,'http://www.k-monitor.hu/hirek/magyar-hirek/a-fideszesekkel-egyutt-zart-ulesen-targyalnak-szilvasyekrol-a-parlamentben',NULL,NULL,'normal',NULL),(357,'Helleréknek most is jut támogatás','\r\n		Az előző évek MSZP-kabinetjeivel szemben a Fidesz–KDNP-kormány kultúrpolitikájának nyitottságát demonstrálja, hogy a Nemzeti Kulturális Alap (NKA) a balliberális szerzőket és kiadóikat több százezer, esetenként milliós állami támogatásban részesíti. Így kaphattak áprilisban juttatást a Heller Ágnes és Jürgen Habermas könyveinek kiadását gondozó kiadók.	','hirek/magyar-hirek/hellereknek-most-is-jut-tamogatas','2011-11-17 21:26:23','2011-11-17 21:26:23',2,'http://www.k-monitor.hu/hirek/magyar-hirek/hellereknek-most-is-jut-tamogatas',NULL,NULL,'normal',NULL),(358,'Az MVM az utolsó töltényig védelmezi Kocsisék offshore-, szálloda-, és atomtitkait','\r\n		A Lehet Más a Politika (LMP) 2009 nyarán fordult az állami áramszolgáltató Magyar Villamos Művek Zrt.-hez azt kérve, hogy hozza nyilvánosságra a milliárdos 2008-as offshore- és szállodaügyletéről szóló belső vizsgálati jelentéseket és a vizsgálatok költségét, de a cég üzleti titokra, illetve a folyamatban lévő büntetőeljárásra hivatkozva elutasította az adatigénylést.	','hirek/magyar-hirek/az-mvm-az-utolso-toltenyig-vedelmezi-kocsisek-offshore-szalloda-es-atomtitkait','2011-11-17 21:26:24','2011-11-17 21:26:24',2,'http://www.k-monitor.hu/hirek/magyar-hirek/az-mvm-az-utolso-toltenyig-vedelmezi-kocsisek-offshore-szalloda-es-atomtitkait',NULL,NULL,'normal',NULL),(359,'Vádak Szilvásyék ellen: Kémkedtek? Mikor? Kinek?','\r\n		Szombaton a Budapesti Katonai Ügyészség a lakásán tartott házkutatás után gyanúsítottként hallgatta ki, majd őrizetbe vette Laborc Sándort, a Nemzetbiztonsági Hivatal (NBH) volt főigazgatóját, akit információink szerint bűnpártolással gyanúsítanak.	','hirek/magyar-hirek/vadak-szilvasyek-ellen-kemkedtek-mikor-kinek','2011-11-17 21:26:25','2011-11-17 21:26:25',2,'http://www.k-monitor.hu/hirek/magyar-hirek/vadak-szilvasyek-ellen-kemkedtek-mikor-kinek',NULL,NULL,'normal',NULL),(360,'A Szilvásy-ügynek csak rossz vége lehet','\r\n		A helyzet komoly. Vagy azért, mert a katonai ügyészség alappal gyanúsítja bűncselekményekkel a köztársaság titkosszolgálatának volt vezetőit és az őket felügyelő egykori minisztert	','hirek/magyar-hirek/a-szilvasy-ugynek-csak-rossz-vege-lehet','2011-11-17 21:26:28','2011-11-17 21:26:28',2,'http://www.k-monitor.hu/hirek/magyar-hirek/a-szilvasy-ugynek-csak-rossz-vege-lehet',NULL,NULL,'normal',NULL),(361,'Hol találkozik Galambos, Szilvásy és Laborc útja?','\r\n		Néhány nap leforgása alatt őrizetbe vették a hatóságok a polgári titkosszolgálatok két korábbi vezetőjét - Laborc Sándort és Galambos Lajost -, valamint a területet korábban felügyelő minisztert, Szilvásy Györgyöt. Semmit nem tudni hivatalosan arról, hogy mivel gyanúsítják őket, és azt is csak sejteni lehet, hogy az ellenük folyó eljárások összefüggnek egymással. Ki ez a három ember, és milyen érintkezések vannak a pályájukban?	','hirek/magyar-hirek/hol-talalkozik-galambos-szilvasy-es-laborc-utja-1','2011-11-17 21:26:32','2011-11-17 21:26:32',2,'http://www.k-monitor.hu/hirek/magyar-hirek/hol-talalkozik-galambos-szilvasy-es-laborc-utja-1',NULL,NULL,'normal',NULL),(362,'Budapest \"nagy tehetsége\" is a bundával gyanúsított focibírók között van','\r\n		Egyiküket Budapest egyik legjobb bírójának tartották, és társainál is inkább csak a stílussal voltak problémák - mondták az [origo] által megkérdezett ismerősök, kollégák és családtagok a bundázással gyanúsított négy játékvezetőről. A beszámolók alapján a bírókon nem látszott, hogy felvetné őket a pénz, és a viselkedésük sem változott meg a februárban kirobbant antalyai botrány óta.	','hirek/magyar-hirek/budapest-nagy-tehetsege-is-a-bundaval-gyanusitott-focibirok-kozott-van','2011-11-17 21:26:36','2011-11-17 21:26:36',2,'http://www.k-monitor.hu/hirek/magyar-hirek/budapest-nagy-tehetsege-is-a-bundaval-gyanusitott-focibirok-kozott-van',NULL,NULL,'normal',NULL),(363,'Van-e politikai szál a Galambos-ügyben?','\r\n		Gálszécsy András, az Antall-kormány titkosszolgálatokat felügyelő minisztere szerint kizárható a politikai szál a Galambos-ügyben, mivel egy volt miniszter és egy titkosszolgálati vezető eljárás alá vonása sokkal nagyobb kár okozhat, mint amekkora hasznot hajtana.	','hirek/magyar-hirek/van-e-politikai-szal-a-galambos-ugyben','2011-11-17 21:26:57','2011-11-17 21:26:57',2,'http://www.k-monitor.hu/hirek/magyar-hirek/van-e-politikai-szal-a-galambos-ugyben',NULL,NULL,'normal',NULL),(364,'Rámozdul az évszázad üzletére a kormányzati kötődésű cégbirodalom','\r\n		Egymás után nyeri el a közpénzből fizetett energetikai megbízásokat egy cégcsoport, amely a kormányzati kapcsolatairól és rendkívüli megerősödéséről ismertté vált Közgép érdekeltségei közé tartozik. Az állam már most is tízmilliárdokat költ energetikai beruházásokra, de ez minden számítás szerint csak nőni fog a jövőben.	','hirek/magyar-hirek/ramozdul-az-evszazad-uzletere-a-kormanyzati-kotodesu-cegbirodalom','2011-11-17 21:26:59','2011-11-17 21:26:59',2,'http://www.k-monitor.hu/hirek/magyar-hirek/ramozdul-az-evszazad-uzletere-a-kormanyzati-kotodesu-cegbirodalom',NULL,NULL,'normal',NULL),(365,'Rendkívüli ülést hív össze a nemzetbiztonsági bizottság MSZP-s elnöke','\r\n		Az Országgyűlés Nemzetbiztonsági Bizottságának szocialista elnöke hétfő délelőttre rendkívüli ülésre hívta össze a testületet.	','hirek/magyar-hirek/rendkivuli-ulest-hiv-ossze-a-nemzetbiztonsagi-bizottsag-mszp-s-elnoke','2011-11-17 21:27:53','2011-11-17 21:27:53',2,'http://www.k-monitor.hu/hirek/magyar-hirek/rendkivuli-ulest-hiv-ossze-a-nemzetbiztonsagi-bizottsag-mszp-s-elnoke',NULL,NULL,'normal',NULL),(366,'Gyanúsítottként hallgatták ki Laborc Sándort + Videó','\r\n		Laborc Sándort, a Nemzetbiztonsági Hivatal (NBH) korábbi főigazgatóját szombaton gyanúsítottként hallgatták ki, majd vették őrizetbe – erősítette meg a volt főigazgató ügyvédje vasárnap az MTI-nek a hírt.	','hirek/magyar-hirek/gyanusitottkent-hallgattak-ki-laborc-sandort-video','2011-11-17 21:27:56','2011-11-17 21:27:56',2,'http://www.k-monitor.hu/hirek/magyar-hirek/gyanusitottkent-hallgattak-ki-laborc-sandort-video',NULL,NULL,'normal',NULL),(367,'Laborc Sándort is őrizetbe vették','\r\n		Szilvásy György után őrizetbe vették Laborc Sándort is – tudta meg a Hír Televízió. A KGB akadémián végzett tiszt Szilvásy György minisztersége ideje alatt irányította a Nemzetbiztonsági Hivatalt.	','hirek/magyar-hirek/laborc-sandort-is-orizetbe-vettek','2011-11-17 21:27:57','2011-11-17 21:27:57',2,'http://www.k-monitor.hu/hirek/magyar-hirek/laborc-sandort-is-orizetbe-vettek',NULL,NULL,'normal',NULL),(368,'Navracsicsék megnyitották a Gyurcsány-korszak botránykövét','\r\n		Hét év, az eredetileg tervezett összeg duplája, körülbelül egymilliárd forint elköltése, titkosított vizsgálat, felsővezetők kirúgása, rendőrségi nyomozás, politikusi ígérgetések és petíciók után 2011. július 1-én váratlanul megnyitott a budapesti Design Terminál. A volt Erzsébet téri buszpályaudvar épületében működő design központtal ambiciózus tervei vannak a jelenlegi kormányzatnak, de eddigi történetével inkább a hanyagság, a korrupció és a pénzpazarlás állatorvosi lova lett.	','hirek/magyar-hirek/navracsicsek-megnyitottak-a-gyurcsany-korszak-botranykovet','2011-11-17 21:28:01','2011-11-17 21:28:01',2,'http://www.k-monitor.hu/hirek/magyar-hirek/navracsicsek-megnyitottak-a-gyurcsany-korszak-botranykovet',NULL,NULL,'normal',NULL),(369,'Vissza az ellopott vagyont!','\r\n		Miután csaknem egyéves egyeztetést követően nemrég megegyezés született a kormány és a szakszervezetek között a Magyar Nemzeti Üdülési Alapítvány kuratóriumának új összetételéről, valamint az alapító okirat módosításáról, s a Kormányzati Ellenőrzési Hivatal átvilágította az alapítvány előző évekbeli gazdálkodását, a kabinet folytatni kívánja az elmúlt húsz évben elkótyavetyélt, „véglegesen ellopottnak hitt” szakszervezeti vagyonelemek visszaszerzését.	','hirek/magyar-hirek/vissza-az-ellopott-vagyont','2011-11-17 21:28:05','2011-11-17 21:28:05',2,'http://www.k-monitor.hu/hirek/magyar-hirek/vissza-az-ellopott-vagyont',NULL,NULL,'normal',NULL),(370,'Kémkedéssel gyanúsítják Galambost','\r\n		Kémkedéssel gyanúsítja a Budapesti Katonai Ügyészség Galambos Lajost, a Nemzetbiztonsági Hivatal (NBH) egykori főigazgatóját, akit tegnap a Fővárosi Bíróság Katonai Tanácsa házi őrizetbe helyezett.	','hirek/magyar-hirek/kemkedessel-gyanusitjak-galambost','2011-11-17 21:28:09','2011-11-17 21:28:09',2,'http://www.k-monitor.hu/hirek/magyar-hirek/kemkedessel-gyanusitjak-galambost',NULL,NULL,'normal',NULL),(371,'Távozik a Mezőhegyesi Ménesbirtok Zrt-től Szaxon J. Attila','\r\n		Budai Gyula elszámoltatási kormánybiztos a cég 2004-es privatizációjának ügyében, hűtlen kezelés gyanúja miatt feljelentést tett még májusban.	','hirek/magyar-hirek/tavozik-a-mezohegyesi-menesbirtok-zrt-tol-szaxon-j-attila','2011-11-17 21:28:15','2011-11-17 21:28:15',2,'http://www.k-monitor.hu/hirek/magyar-hirek/tavozik-a-mezohegyesi-menesbirtok-zrt-tol-szaxon-j-attila',NULL,NULL,'normal',NULL),(372,'Őrizetbe vették Szilvásy Györgyöt','\r\n		Értesüléseink szerint nemrég elkezdődött a házkutatás Szilvásy György, a Gyurcsány-kormány egykori titokminiszterénél, akit meg nem erősített információink szerint már őrizetbe is vettek. A katonai ügyészség nem kommentálta a hírt.	','hirek/magyar-hirek/orizetbe-vettek-szilvasy-gyorgyot','2011-11-17 21:28:16','2011-11-17 21:28:16',2,'http://www.k-monitor.hu/hirek/magyar-hirek/orizetbe-vettek-szilvasy-gyorgyot',NULL,NULL,'normal',NULL),(373,'Kémkedéssel gyanúsítják Galambos Lajos, egykori NBH főigazgatót','\r\n		Házi őrizetbe helyezte pénteken a bíróság a Nemzetbiztonsági Hivatal (NBH) egykori főigazgatóját, Galambos Lajost kémkedéssel gyanúsítják.	','hirek/magyar-hirek/kemkedessel-gyanusitjak-galambos-lajos-egykori-nbh-foigazgatot','2011-11-17 21:28:19','2011-11-17 21:28:19',2,'http://www.k-monitor.hu/hirek/magyar-hirek/kemkedessel-gyanusitjak-galambos-lajos-egykori-nbh-foigazgatot',NULL,NULL,'normal',NULL),(374,'Újabb ingatlanügy Terézvárosban','\r\n		Újabb ingatlanügyben nyomoz a BRFK Terézvárosban, ezúttal a Liszt Ferenc tér 7. szám alatt lévő – 2005 novemberében eladott – ház ügyében.	','hirek/magyar-hirek/ujabb-ingatlanugy-terezvarosban','2011-11-17 21:28:19','2011-11-17 21:28:19',2,'http://www.k-monitor.hu/hirek/magyar-hirek/ujabb-ingatlanugy-terezvarosban',NULL,NULL,'normal',NULL),(375,'Mihályi Péter: Sukoró','\r\n		2011 közepére Sukorón hatcsillagos turisztikai és szórakoztató komplexum, benne golfpálya, fedett sí- és korcsolyapálya, valamint egy első osztályú játékkaszinó jött volna létre. A létesítmény a maga nemében a legnagyobb lett volna egész Európában.	','hirek/magyar-hirek/mihalyi-peter-sukoro','2011-11-17 21:28:22','2011-11-17 21:28:22',2,'http://www.k-monitor.hu/hirek/magyar-hirek/mihalyi-peter-sukoro',NULL,NULL,'normal',NULL);
